eval("module.exports = \"<h1 id=\\\"event\\\">Event</h1>\\n<p>图表交互是打通人与冰冷数据的桥梁，viser 提供一系列的交互事件，帮助实现图表数据的二次呈现，比如下钻上卷。我们一共支持共 14 种事件。</p>\\n<ul>\\n<li>鼠标移动事件： onMouseDown,onMouseMove,onMouseLeave,onMouseUp,</li>\\n<li>鼠标点击事件： onClick,onDbClick,</li>\\n<li>移动端事件： onTouchStart,onTouchMove,onTouchEnd,</li>\\n<li>图表区域事件： onPlotEnter,onPlotMove,onPlotLeave,onPlotClick,onPlotDbClick</li>\\n</ul>\\n<p>除此之外，axis,legend 标签有部分特殊事件。</p>\\n<p>事件的回调函数提供 事件 event 和 图表实例 chart 两个参数，方便用户获取事件源及数据 ，并对图表实例做相应的处理。</p>\\n<p>下面我们来了解下每个标签具体支持哪些事件把。</p>\\n<h2 id=\\\"-\\\">标签及支持的事件</h2>\\n<h3 id=\\\"-chart\\\">图表 Chart</h3>\\n<p>图表标签 chart 支持</p>\\n<ul>\\n<li>鼠标移动事件： onMouseDown,onMouseMove,onMouseLeave,onMouseUp,</li>\\n<li>鼠标点击事件： onClick,onDbClick,</li>\\n<li>移动端事件： onTouchStart,onTouchMove,onTouchEnd,</li>\\n<li>图表区域事件： onPlotEnter,onPlotMove,onPlotLeave,onPlotClick,onPlotDbClick</li>\\n</ul>\\n<p>代码示例：</p>\\n<pre><code class=\\\"lang-javascript\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Chart</span>\\n  <span class=\\\"hljs-attr\\\">forceFit</span>\\n  <span class=\\\"hljs-attr\\\">height</span>=<span class=\\\"hljs-string\\\">{400}</span>\\n  <span class=\\\"hljs-attr\\\">data</span>=<span class=\\\"hljs-string\\\">{data}</span>\\n  <span class=\\\"hljs-attr\\\">scale</span>=<span class=\\\"hljs-string\\\">{scale}</span>\\n  <span class=\\\"hljs-attr\\\">onClick</span>=<span class=\\\"hljs-string\\\">{(ev,</span> <span class=\\\"hljs-attr\\\">chart</span>) =&gt;</span> {\\n    // todo sth\\n  }}\\n&gt;\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Tooltip</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Axis</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Line</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Point</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> <span class=\\\"hljs-attr\\\">shape</span>=<span class=\\\"hljs-string\\\">\\\"circle\\\"</span> /&gt;</span>\\n<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">Chart</span>&gt;</span>\\n</code></pre>\\n<h3 id=\\\"-\\\">图形元素</h3>\\n<p>图形元素标签包括：pie,line,smoothLine,dashLine,stackLine,area,stackArea,smoothArea,interval,\\nstackInterval,dodgeInterval,bar,stackBar,dodgeBar,point,funnel,pyramid,schema,box,candle,polygon,contour,heatmap,\\nedge,sankey,errorBar,jitterPoint,path,series</p>\\n<p>支持事件</p>\\n<ul>\\n<li>鼠标移动事件： onMouseDown,onMouseMove,onMouseLeave,onMouseUp,</li>\\n<li>鼠标点击事件： onClick,onDbClick,</li>\\n<li>移动端事件： onTouchStart,onTouchMove,onTouchEnd,</li>\\n</ul>\\n<p><img src=\\\"/assets/image/series_label_component.png\\\" width=\\\"450\\\" height=\\\"250\\\"/></p>\\n<h4 id=\\\"label-\\\">label 组件 （修复中）</h4>\\n<ul>\\n<li>鼠标移动事件： onLabelMouseDown,onLabelMouseMove,onLabelMouseLeave,onLabelMouseUp,</li>\\n<li>鼠标点击事件： onLabelClick,onLabelDbClick,</li>\\n<li>移动端事件： onLableTouchStart,onLabelTouchMove,onLabelTouchEnd</li>\\n</ul>\\n<p>代码示例：</p>\\n<pre><code class=\\\"lang-javascript\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Chart</span> <span class=\\\"hljs-attr\\\">forceFit</span> <span class=\\\"hljs-attr\\\">height</span>=<span class=\\\"hljs-string\\\">{400}</span> <span class=\\\"hljs-attr\\\">data</span>=<span class=\\\"hljs-string\\\">{data}</span> <span class=\\\"hljs-attr\\\">scale</span>=<span class=\\\"hljs-string\\\">{scale}</span>&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Tooltip</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Axis</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Line</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Point</span>\\n    <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span>\\n    <span class=\\\"hljs-attr\\\">shape</span>=<span class=\\\"hljs-string\\\">\\\"circle\\\"</span>\\n    <span class=\\\"hljs-attr\\\">onClick</span>=<span class=\\\"hljs-string\\\">{(ev,</span> <span class=\\\"hljs-attr\\\">chart</span>) =&gt;</span> {\\n      // todo sth\\n    }}\\n  /&gt;\\n<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">Chart</span>&gt;</span>\\n</code></pre>\\n<h3 id=\\\"-tooltip\\\">提示 Tooltip</h3>\\n<p>提示 tooltip 标签，支持 onShow,onHide,onChange 这个事件常用于动态更改显示信息。</p>\\n<p>代码示例：</p>\\n<pre><code class=\\\"lang-javascript\\\">&lt;Chart forceFit height={<span class=\\\"hljs-number\\\">400</span>} data={data} scale={scale}&gt;\\n  &lt;Tooltip\\n    showTitle={false}\\n    onChange={(ev, chart) =&gt; {\\n      const item = ev.items[<span class=\\\"hljs-number\\\">0</span>]; // 获取tooltip要显示的内容\\n      item.value = <span class=\\\"hljs-string\\\">'格式化-'</span> + (item.value * <span class=\\\"hljs-number\\\">100</span>).toFixed(<span class=\\\"hljs-number\\\">2</span>) + <span class=\\\"hljs-string\\\">'%'</span>;\\n    }}\\n  /&gt;\\n  &lt;Coord type=<span class=\\\"hljs-string\\\">\\\"theta\\\"</span> /&gt;\\n  &lt;Axis /&gt;\\n  &lt;Legend dataKey=<span class=\\\"hljs-string\\\">\\\"item\\\"</span> /&gt;\\n  &lt;Pie\\n    position=<span class=\\\"hljs-string\\\">\\\"percent\\\"</span>\\n    color=<span class=\\\"hljs-string\\\">\\\"item\\\"</span>\\n    style={{ stroke: <span class=\\\"hljs-string\\\">'#fff'</span>, lineWidth: <span class=\\\"hljs-number\\\">1</span> }}\\n    label={[\\n      <span class=\\\"hljs-string\\\">'percent'</span>,\\n      {\\n        formatter: (val, item) =&gt; {\\n          return item.point.item + <span class=\\\"hljs-string\\\">': '</span> + val;\\n        },\\n      },\\n    ]}\\n  /&gt;\\n&lt;/Chart&gt;\\n</code></pre>\\n<h3 id=\\\"-axis\\\">坐标轴 Axis</h3>\\n<p>坐标轴 axis 标签，支持非常多的事件。</p>\\n<p><img src=\\\"/assets/image/axis_component.png\\\" width=\\\"600\\\" height=\\\"350\\\"></p>\\n<h3 id=\\\"title-\\\">title 组件</h3>\\n<ul>\\n<li>鼠标移动事件： onTitleMouseDown,onTitleMouseMove,onTitleMouseLeave,onTitleMouseUp,</li>\\n<li>鼠标点击事件： onTitleClick,onTitleDbClick,</li>\\n<li>移动端事件： onTitleTouchStart,onTitleTouchMove,onTitleTouchEnd,</li>\\n</ul>\\n<h3 id=\\\"label-\\\">label 组件</h3>\\n<ul>\\n<li>鼠标移动事件： onLabelMouseDown,onLabelMouseMove,onLabelMouseLeave,onLabelMouseUp,</li>\\n<li>鼠标点击事件： onLabelClick,onLabelDbClick,</li>\\n<li>移动端事件： onLabelTouchStart,onLabelTouchMove,onLabelTouchEnd,</li>\\n</ul>\\n<h3 id=\\\"ticks-\\\">ticks 组件</h3>\\n<ul>\\n<li>鼠标移动事件： onTicksMouseDown,onTicksMouseMove,onTicksMouseLeave,onTicksMouseUp,</li>\\n<li>鼠标点击事件： onTicksClick,onTicksDbClick,</li>\\n<li>移动端事件： onTicksTouchStart,onTicksTouchMove,onTicksTouchEnd,</li>\\n</ul>\\n<h3 id=\\\"-\\\">线组件</h3>\\n<ul>\\n<li>鼠标移动事件： onLineMouseDown,onLineMouseMove,onLineMouseLeave,onLineMouseUp,</li>\\n<li>鼠标点击事件： onLineClick,onLineDbClick,</li>\\n<li>移动端事件： onLineTouchStart,onLineTouchMove,onLineTouchEnd,</li>\\n</ul>\\n<h3 id=\\\"-\\\">网格组件</h3>\\n<ul>\\n<li>鼠标移动事件： onGridMouseDown,onGridMouseMove,onGridMouseLeave,onGridMouseUp,</li>\\n<li>鼠标点击事件： onGridClick,onGridDbClick,</li>\\n<li>移动端事件： onGridTouchStart,onGridTouchMove,onGridTouchEnd,</li>\\n</ul>\\n<p>代码示例：</p>\\n<pre><code class=\\\"lang-javascript\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Chart</span> <span class=\\\"hljs-attr\\\">forceFit</span> <span class=\\\"hljs-attr\\\">height</span>=<span class=\\\"hljs-string\\\">{400}</span> <span class=\\\"hljs-attr\\\">data</span>=<span class=\\\"hljs-string\\\">{data}</span> <span class=\\\"hljs-attr\\\">scale</span>=<span class=\\\"hljs-string\\\">{scale}</span>&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Tooltip</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Axis</span>\\n    <span class=\\\"hljs-attr\\\">onTitleMouseDown</span>=<span class=\\\"hljs-string\\\">{(ev,</span> <span class=\\\"hljs-attr\\\">chart</span>) =&gt;</span> {\\n      // todo sth\\n    }}\\n  /&gt;\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Line</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Point</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> <span class=\\\"hljs-attr\\\">shape</span>=<span class=\\\"hljs-string\\\">\\\"circle\\\"</span> /&gt;</span>\\n<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">Chart</span>&gt;</span>\\n</code></pre>\\n<h3 id=\\\"-legend\\\">图例 Legend</h3>\\n<ul>\\n<li>本身支持的事件： onHover,onClick</li>\\n</ul>\\n<p><img src=\\\"/assets/image/legend_component.png\\\" width=\\\"350\\\" height=\\\"200\\\"/></p>\\n<h3 id=\\\"-\\\">标题组件</h3>\\n<p>title 组件在使用时要注意，只有 position 为 left right (示例：<code>&lt;Legend position=&quot;left or right&quot; title={{}}&gt;</code>)才会显示出来，展示的内容是字段名称, <code>&lt;Legend position=&quot;left or right&quot; title={null}&gt;</code>可以隐藏 title 。</p>\\n<ul>\\n<li>鼠标移动事件： onTitleMouseDown,onTitleMouseMove,onTitleMouseLeave,onTitleMouseUp,</li>\\n<li>鼠标点击事件： onTitleClick,onTitleDbClick,</li>\\n<li>移动端事件： onTitleTouchStart,onTitleTouchMove,onTitleTouchEnd,</li>\\n</ul>\\n<h3 id=\\\"item-\\\">item 组件</h3>\\n<ul>\\n<li>鼠标移动事件： onItemMouseDown,onItemMouseMove,onItemMouseLeave,onItemMouseUp,</li>\\n<li>鼠标点击事件： onItemClick,onItemDbClick,</li>\\n<li>移动端事件： onItemTouchStart,onItemTouchMove,onItemTouchEnd,</li>\\n</ul>\\n<h3 id=\\\"marker-\\\">marker 组件</h3>\\n<ul>\\n<li>鼠标移动事件： onMarkerMouseDown,onMarkerMouseMove,onMarkerMouseLeave,onMarkerMouseUp,</li>\\n<li>鼠标点击事件： onMarkerClick,onMarkerDbClick,</li>\\n<li>移动端事件： onMarkerTouchStart,onMarkerTouchMove,onMarkerTouchEnd,</li>\\n</ul>\\n<h3 id=\\\"text-\\\">text 组件</h3>\\n<ul>\\n<li>鼠标移动事件： onTextMouseDown,onTextMouseMove,onTextMouseLeave,onTextMouseUp,</li>\\n<li>鼠标点击事件： onTextClick,onTextDbClick,</li>\\n<li>移动端事件： onTextTouchStart,onTextTouchMove,onTextTouchEnd,</li>\\n</ul>\\n<p>代码示例：</p>\\n<pre><code class=\\\"lang-javascript\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Chart</span> <span class=\\\"hljs-attr\\\">forceFit</span> <span class=\\\"hljs-attr\\\">height</span>=<span class=\\\"hljs-string\\\">{400}</span> <span class=\\\"hljs-attr\\\">data</span>=<span class=\\\"hljs-string\\\">{data}</span> <span class=\\\"hljs-attr\\\">scale</span>=<span class=\\\"hljs-string\\\">{scale}</span>&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Tooltip</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Axis</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Legend</span>\\n    <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"left\\\"</span>\\n    <span class=\\\"hljs-attr\\\">title</span>=<span class=\\\"hljs-string\\\">\\\"field\\\"</span>\\n    <span class=\\\"hljs-attr\\\">onTextMouseDown</span>=<span class=\\\"hljs-string\\\">{(ev,</span> <span class=\\\"hljs-attr\\\">chart</span>) =&gt;</span> {\\n      // todo sth\\n    }}\\n  /&gt;\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Line</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Point</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> <span class=\\\"hljs-attr\\\">shape</span>=<span class=\\\"hljs-string\\\">\\\"circle\\\"</span> /&gt;</span>\\n<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">Chart</span>&gt;</span>\\n</code></pre>\\n<h3 id=\\\"-guide-to-be-done-\\\">引导 Guide ( to be done)</h3>\\n<p>支持事件</p>\\n<ul>\\n<li>鼠标移动事件： onMouseDown,onMouseMove,onMouseLeave,onMouseUp,</li>\\n<li>鼠标点击事件： onClick,onDbClick,</li>\\n<li>移动端事件： onTouchStart,onTouchMove,onTouchEnd,</li>\\n</ul>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/api/event/cn.md?");

