eval("module.exports = \"<h2 id=\\\"summary\\\">summary</h2>\\n<p>The interaction of diagrams is the bridge between people and cold data. Viser provides a series of interaction events to help achieve the second presentation of the chart data, such as drilling or rollup. We have supported about 14 kinds of events.</p>\\n<ul>\\n<li>Mouse movement event： onMouseDown,onMouseMove,onMouseLeave,onMouseUp,</li>\\n<li>Mouse click event： onClick,onDbClick,</li>\\n<li>Mobile event： onTouchStart,onTouchMove,onTouchEnd,</li>\\n<li>Chart area events： onPlotEnter,onPlotMove,onPlotLeave,onPlotClick,onPlotDbClick</li>\\n</ul>\\n<p>In addition,  axis and legend tag has some special events.</p>\\n<p>The event callback function provides two parameters, the event  and the chart instance , to facilitate the user to obtain the event source and data, and to handle the chart instance according to the actual scene.</p>\\n<p>Let&#39;s come to see each tag support what kind of events and how can we code to implement requirements.</p>\\n<h2 id=\\\"labels-and-supported-events\\\">Labels and Supported Events</h2>\\n<h3 id=\\\"chart\\\">Chart</h3>\\n<p>Chart tag support</p>\\n<ul>\\n<li>Mouse movement event： onMouseDown,onMouseMove,onMouseLeave,onMouseUp,</li>\\n<li>Mouse click event： onClick,onDbClick,</li>\\n<li>Mobile event： onTouchStart,onTouchMove,onTouchEnd,</li>\\n<li>Chart area events： onPlotEnter,onPlotMove,onPlotLeave,onPlotClick,onPlotDbClick</li>\\n</ul>\\n<p>Code example：</p>\\n<pre><code class=\\\"lang-javascript\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Chart</span> <span class=\\\"hljs-attr\\\">forceFit</span> <span class=\\\"hljs-attr\\\">height</span>=<span class=\\\"hljs-string\\\">{400}</span> <span class=\\\"hljs-attr\\\">data</span>=<span class=\\\"hljs-string\\\">{data}</span> <span class=\\\"hljs-attr\\\">scale</span>=<span class=\\\"hljs-string\\\">{scale}</span> <span class=\\\"hljs-attr\\\">onClick</span>=<span class=\\\"hljs-string\\\">{(ev,</span> <span class=\\\"hljs-attr\\\">chart</span>) =&gt;</span> {\\n  // todo sth\\n}}&gt;\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Tooltip</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Axis</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Line</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Point</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> <span class=\\\"hljs-attr\\\">shape</span>=<span class=\\\"hljs-string\\\">\\\"circle\\\"</span> /&gt;</span>\\n<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">Chart</span>&gt;</span>\\n</code></pre>\\n<h3 id=\\\"graphic-element\\\">Graphic element</h3>\\n<p>Graphic element tags include：pie,line,smoothLine,dashLine,stackLine,area,stackArea,smoothArea,interval,\\nstackInterval,dodgeInterval,bar,stackBar,dodgeBar,point,funnel,pyramid,schema,box,candle,polygon,contour,heatmap,\\nedge,sankey,errorBar,jitterPoint,path,series</p>\\n<p>Support event</p>\\n<ul>\\n<li>Mouse movement event： onMouseDown,onMouseMove,onMouseLeave,onMouseUp,</li>\\n<li>Mouse click event： onClick,onDbClick,</li>\\n<li>Mobile event： onTouchStart,onTouchMove,onTouchEnd,</li>\\n</ul>\\n<p><img src=\\\"/assets/image/series_label_component.png\\\" width=\\\"450\\\" height=\\\"250\\\"/></p>\\n<h4 id=\\\"label\\\">label</h4>\\n<ul>\\n<li>Mouse movement event： onLabelMouseDown,onLabelMouseMove,onLabelMouseLeave,onLabelMouseUp,</li>\\n<li>Mouse click event： onLabelClick,onLabelDbClick,</li>\\n<li>Mobile event： onLableTouchStart,onLabelTouchMove,onLabelTouchEnd</li>\\n</ul>\\n<p>Code example：</p>\\n<pre><code class=\\\"lang-javascript\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Chart</span> <span class=\\\"hljs-attr\\\">forceFit</span> <span class=\\\"hljs-attr\\\">height</span>=<span class=\\\"hljs-string\\\">{400}</span> <span class=\\\"hljs-attr\\\">data</span>=<span class=\\\"hljs-string\\\">{data}</span> <span class=\\\"hljs-attr\\\">scale</span>=<span class=\\\"hljs-string\\\">{scale}</span> &gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Tooltip</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Axis</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Line</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Point</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> <span class=\\\"hljs-attr\\\">shape</span>=<span class=\\\"hljs-string\\\">\\\"circle\\\"</span> <span class=\\\"hljs-attr\\\">onClick</span>=<span class=\\\"hljs-string\\\">{(ev,</span> <span class=\\\"hljs-attr\\\">chart</span>) =&gt;</span> {\\n    // todo sth\\n  }}/&gt;\\n<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">Chart</span>&gt;</span>\\n</code></pre>\\n<h3 id=\\\"tooltip\\\">Tooltip</h3>\\n<p>Tooltip tag, support onShow,onHide,onChange(This event is often used to dynamically change the displayed information).</p>\\n<p>Code example：</p>\\n<pre><code class=\\\"lang-javascript\\\">&lt;Chart forceFit height={<span class=\\\"hljs-number\\\">400</span>} data={data} scale={scale}&gt;\\n  &lt;Tooltip showTitle={false} onChange={(ev, chart) =&gt; {\\n    const item = ev.items[<span class=\\\"hljs-number\\\">0</span>]; // get tooltip content\\n    item.value = <span class=\\\"hljs-string\\\">'format-'</span> + (item.value * <span class=\\\"hljs-number\\\">100</span>).toFixed(<span class=\\\"hljs-number\\\">2</span>) + <span class=\\\"hljs-string\\\">'%'</span>;\\n  }}/&gt;\\n  &lt;Coord type=<span class=\\\"hljs-string\\\">\\\"theta\\\"</span> /&gt;\\n  &lt;Axis /&gt;\\n  &lt;Legend dataKey=<span class=\\\"hljs-string\\\">\\\"item\\\"</span> /&gt;\\n  &lt;Pie\\n    position=<span class=\\\"hljs-string\\\">\\\"percent\\\"</span>\\n    color=<span class=\\\"hljs-string\\\">\\\"item\\\"</span>\\n    style={{ stroke: <span class=\\\"hljs-string\\\">'#fff'</span>, lineWidth: <span class=\\\"hljs-number\\\">1</span> }}\\n    label={[<span class=\\\"hljs-string\\\">'percent'</span>, {\\n      formatter: (val, item) =&gt; {\\n        return item.point.item + <span class=\\\"hljs-string\\\">': '</span> + val;\\n      }\\n    }]}\\n  /&gt;\\n&lt;/Chart&gt;\\n</code></pre>\\n<h3 id=\\\"axis\\\">Axis</h3>\\n<p>Axis label, support for many events。</p>\\n<p><img src=\\\"/assets/image/axis_component.png\\\" width=\\\"600\\\" height=\\\"350\\\"></p>\\n<h4 id=\\\"title\\\">title</h4>\\n<ul>\\n<li>Mouse movement event： onTitleMouseDown,onTitleMouseMove,onTitleMouseLeave,onTitleMouseUp,</li>\\n<li>Mouse click event： onTitleClick,onTitleDbClick,</li>\\n<li>Mobile event： onTitleTouchStart,onTitleTouchMove,onTitleTouchEnd,</li>\\n</ul>\\n<h3 id=\\\"label\\\">label</h3>\\n<ul>\\n<li>Mouse movement event： onLabelMouseDown,onLabelMouseMove,onLabelMouseLeave,onLabelMouseUp,</li>\\n<li>Mouse click event： onLabelClick,onLabelDbClick,</li>\\n<li>Mobile event： onLabelTouchStart,onLabelTouchMove,onLabelTouchEnd,</li>\\n</ul>\\n<h3 id=\\\"ticks\\\">ticks</h3>\\n<ul>\\n<li>Mouse movement event： onTicksMouseDown,onTicksMouseMove,onTicksMouseLeave,onTicksMouseUp,</li>\\n<li>Mouse click event： onTicksClick,onTicksDbClick,</li>\\n<li>Mobile event： onTicksTouchStart,onTicksTouchMove,onTicksTouchEnd,</li>\\n</ul>\\n<h3 id=\\\"line\\\">line</h3>\\n<ul>\\n<li>Mouse movement event： onLineMouseDown,onLineMouseMove,onLineMouseLeave,onLineMouseUp,</li>\\n<li>Mouse click event： onLineClick,onLineDbClick,</li>\\n<li>Mobile event： onLineTouchStart,onLineTouchMove,onLineTouchEnd,</li>\\n</ul>\\n<h3 id=\\\"grid\\\">grid</h3>\\n<ul>\\n<li>Mouse movement event： onGridMouseDown,onGridMouseMove,onGridMouseLeave,onGridMouseUp,</li>\\n<li>Mouse click event： onGridClick,onGridDbClick,</li>\\n<li>Mobile event： onGridTouchStart,onGridTouchMove,onGridTouchEnd,</li>\\n</ul>\\n<p>Code example：</p>\\n<pre><code class=\\\"lang-javascript\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Chart</span> <span class=\\\"hljs-attr\\\">forceFit</span> <span class=\\\"hljs-attr\\\">height</span>=<span class=\\\"hljs-string\\\">{400}</span> <span class=\\\"hljs-attr\\\">data</span>=<span class=\\\"hljs-string\\\">{data}</span> <span class=\\\"hljs-attr\\\">scale</span>=<span class=\\\"hljs-string\\\">{scale}</span> &gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Tooltip</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Axis</span> <span class=\\\"hljs-attr\\\">onTitleMouseDown</span>=<span class=\\\"hljs-string\\\">{(ev,</span> <span class=\\\"hljs-attr\\\">chart</span>) =&gt;</span> {\\n    // todo sth\\n  }}/&gt;\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Line</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Point</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> <span class=\\\"hljs-attr\\\">shape</span>=<span class=\\\"hljs-string\\\">\\\"circle\\\"</span> /&gt;</span>\\n<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">Chart</span>&gt;</span>\\n</code></pre>\\n<h3 id=\\\"legend\\\">Legend</h3>\\n<ul>\\n<li>Self-supported events： onHover,onClick</li>\\n</ul>\\n<p><img src=\\\"/assets/image/legend_component.png\\\" width=\\\"350\\\" height=\\\"200\\\"/></p>\\n<h3 id=\\\"title\\\">title</h3>\\n<p>Here is some tips, if you are using The title component , only set position equals left  or right (such as: <code>&lt;Legend position=&quot;left or right&quot; title={{}}&gt;</code>), the title component will show，title content is field name. code like this can hide title component <code>&lt;Legend position=&quot;left or right&quot; title={null}&gt;</code> 。</p>\\n<ul>\\n<li>Mouse movement event： onTitleMouseDown,onTitleMouseMove,onTitleMouseLeave,onTitleMouseUp,</li>\\n<li>Mouse click event： onTitleClick,onTitleDbClick,</li>\\n<li>Mobile event： onTitleTouchStart,onTitleTouchMove,onTitleTouchEnd,</li>\\n</ul>\\n<h3 id=\\\"item\\\">item</h3>\\n<ul>\\n<li>Mouse movement event： onItemMouseDown,onItemMouseMove,onItemMouseLeave,onItemMouseUp,</li>\\n<li>Mouse click event： onItemClick,onItemDbClick,</li>\\n<li>Mobile event： onItemTouchStart,onItemTouchMove,onItemTouchEnd,</li>\\n</ul>\\n<h3 id=\\\"marker\\\">marker</h3>\\n<ul>\\n<li>Mouse movement event： onMarkerMouseDown,onMarkerMouseMove,onMarkerMouseLeave,onMarkerMouseUp,</li>\\n<li>Mouse click event： onMarkerClick,onMarkerDbClick,</li>\\n<li>Mobile event： onMarkerTouchStart,onMarkerTouchMove,onMarkerTouchEnd,</li>\\n</ul>\\n<h3 id=\\\"text\\\">text</h3>\\n<ul>\\n<li>Mouse movement event： onTextMouseDown,onTextMouseMove,onTextMouseLeave,onTextMouseUp,</li>\\n<li>Mouse click event： onTextClick,onTextDbClick,</li>\\n<li>Mobile event： onTextTouchStart,onTextTouchMove,onTextTouchEnd,</li>\\n</ul>\\n<p>Code example：</p>\\n<pre><code class=\\\"lang-javascript\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Chart</span> <span class=\\\"hljs-attr\\\">forceFit</span> <span class=\\\"hljs-attr\\\">height</span>=<span class=\\\"hljs-string\\\">{400}</span> <span class=\\\"hljs-attr\\\">data</span>=<span class=\\\"hljs-string\\\">{data}</span> <span class=\\\"hljs-attr\\\">scale</span>=<span class=\\\"hljs-string\\\">{scale}</span> &gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Tooltip</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Axis</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Legend</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"left\\\"</span> <span class=\\\"hljs-attr\\\">title</span>=<span class=\\\"hljs-string\\\">\\\"field\\\"</span> <span class=\\\"hljs-attr\\\">onTextMouseDown</span>=<span class=\\\"hljs-string\\\">{(ev,</span> <span class=\\\"hljs-attr\\\">chart</span>) =&gt;</span> {\\n    // todo sth\\n  }}/&gt;\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Line</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> /&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Point</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> <span class=\\\"hljs-attr\\\">shape</span>=<span class=\\\"hljs-string\\\">\\\"circle\\\"</span> /&gt;</span>\\n<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">Chart</span>&gt;</span>\\n</code></pre>\\n<h3 id=\\\"guide-to-be-done-\\\">Guide  ( to be done)</h3>\\n<p>Support event</p>\\n<ul>\\n<li>Mouse movement event： onMouseDown,onMouseMove,onMouseLeave,onMouseUp,</li>\\n<li>Mouse click event： onClick,onDbClick,</li>\\n<li>Mobile event： onTouchStart,onTouchMove,onTouchEnd,</li>\\n</ul>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/api/event/en.md?");

