eval("module.exports = \"<h1 id=\\\"viser-graph-api\\\">Viser-graph 组件 api</h1>\\n<h2 id=\\\"graph\\\">Graph</h2>\\n<h4 id=\\\"type\\\">type</h4>\\n<p>可选 tree （树状关系图）或者 graph （网状关系图）， 默认 graph。最简单的示例如下：</p>\\n<pre><code class=\\\"lang-javascript\\\">const graph = {\\n  <span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">type</span></span>: <span class=\\\"hljs-symbol\\\">'grap</span>h',\\n  width: <span class=\\\"hljs-number\\\">500</span>,\\n  height: <span class=\\\"hljs-number\\\">500</span>,\\n  fitView: <span class=\\\"hljs-symbol\\\">'c</span>c',\\n  fitViewPadding: <span class=\\\"hljs-literal\\\">true</span>,\\n  animate: <span class=\\\"hljs-literal\\\">true</span>,\\n  minZoom: <span class=\\\"hljs-number\\\">0.2</span>,\\n  maxZoom: <span class=\\\"hljs-number\\\">10</span>,\\n  data,\\n};\\nexport <span class=\\\"hljs-keyword\\\">default</span> <span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">class</span> <span class=\\\"hljs-title\\\">App</span> <span class=\\\"hljs-keyword\\\">extends</span> <span class=\\\"hljs-title\\\">React</span>.<span class=\\\"hljs-title\\\">Component</span> </span>{\\n  constructor(props) {\\n    <span class=\\\"hljs-keyword\\\">super</span>(props);\\n  }\\n  render() {\\n    <span class=\\\"hljs-keyword\\\">return</span> (\\n      &lt;div&gt;\\n        &lt;<span class=\\\"hljs-type\\\">Graph</span> {...graph} /&gt;\\n      &lt;/div&gt;\\n    );\\n  }\\n}\\n</code></pre>\\n<h4 id=\\\"data-object-\\\">data {object} 数据模型 必选</h4>\\n<p>格式：\\ntype 为 graph 、 tree 的数据格式是不一样的。</p>\\n<pre><code class=\\\"lang-javascript\\\"><span class=\\\"hljs-comment\\\">// type === graph</span>\\n{\\n<span class=\\\"hljs-symbol\\\">  nodes:</span>[],\\n<span class=\\\"hljs-symbol\\\">  edges:</span>[],\\n<span class=\\\"hljs-symbol\\\">  groups:</span> [],\\n}\\n<span class=\\\"hljs-comment\\\">// type === tree</span>\\n{\\n<span class=\\\"hljs-symbol\\\">  roots:</span>[]\\n}\\n</code></pre>\\n<p>nodes：节点的数据模型</p>\\n<pre><code class=\\\"lang-javascript\\\">{\\n  <span class=\\\"hljs-attribute\\\">id</span>: <span class=\\\"hljs-string\\\">'node1'</span>,             <span class=\\\"hljs-comment\\\">// id 必须唯一</span>\\n  <span class=\\\"hljs-attribute\\\">x</span>: number,            <span class=\\\"hljs-comment\\\">// 横向位置</span>\\n  <span class=\\\"hljs-attribute\\\">y</span>: number,           <span class=\\\"hljs-comment\\\">// 纵向位置</span>\\n  <span class=\\\"hljs-attribute\\\">color</span>: <span class=\\\"hljs-string\\\">'#333'</span>,           <span class=\\\"hljs-comment\\\">// 颜色</span>\\n  <span class=\\\"hljs-attribute\\\">size</span>: <span class=\\\"hljs-number\\\">10</span> || [<span class=\\\"hljs-number\\\">10</span>, <span class=\\\"hljs-number\\\">10</span>],    <span class=\\\"hljs-comment\\\">// 尺寸 || [宽, 高]</span>\\n  <span class=\\\"hljs-attribute\\\">shape</span>: <span class=\\\"hljs-string\\\">'circle'</span>,         <span class=\\\"hljs-comment\\\">// 所用图形（目前只测验了circle可用）</span>\\n  <span class=\\\"hljs-attribute\\\">style</span>: {                 <span class=\\\"hljs-comment\\\">// 关键形样式（优先级高于color）</span>\\n    <span class=\\\"hljs-attribute\\\">fill</span>: <span class=\\\"hljs-string\\\">'red'</span>,\\n      <span class=\\\"hljs-attribute\\\">stroke</span>: <span class=\\\"hljs-string\\\">'blue'</span>\\n  },\\n  <span class=\\\"hljs-attribute\\\">label</span>: <span class=\\\"hljs-string\\\">'文本标签'</span> || {     <span class=\\\"hljs-comment\\\">// 文本标签 || 文本图形配置</span>\\n    <span class=\\\"hljs-attribute\\\">text</span>: <span class=\\\"hljs-string\\\">'文本标签'</span>,\\n      <span class=\\\"hljs-attribute\\\">fill</span>: <span class=\\\"hljs-string\\\">'green'</span>\\n  },\\n  <span class=\\\"hljs-attribute\\\">parent</span>: <span class=\\\"hljs-string\\\">'group1'</span>,         <span class=\\\"hljs-comment\\\">// 所属组</span>\\n  <span class=\\\"hljs-attribute\\\">index</span>: <span class=\\\"hljs-number\\\">1</span>,                 <span class=\\\"hljs-comment\\\">// 渲染层级（暂未测试）</span>\\n}\\n</code></pre>\\n<p>edges：边的数据模型</p>\\n<pre><code class=\\\"lang-javascript\\\">{\\n  <span class=\\\"hljs-attribute\\\">id</span>: <span class=\\\"hljs-string\\\">'edge1'</span>,           <span class=\\\"hljs-comment\\\">// id 必须唯一</span>\\n  <span class=\\\"hljs-attribute\\\">source</span>: <span class=\\\"hljs-string\\\">'node1'</span>,       <span class=\\\"hljs-comment\\\">// 源节点 id</span>\\n  <span class=\\\"hljs-attribute\\\">target</span>: <span class=\\\"hljs-string\\\">'node2'</span>,       <span class=\\\"hljs-comment\\\">// 目标节点 id</span>\\n  <span class=\\\"hljs-attribute\\\">controlPoints</span>: [{      <span class=\\\"hljs-comment\\\">// 控制点</span>\\n    <span class=\\\"hljs-attribute\\\">x</span>: <span class=\\\"hljs-number\\\">10</span>,\\n      <span class=\\\"hljs-attribute\\\">y</span>: <span class=\\\"hljs-number\\\">10</span>\\n  }],\\n  <span class=\\\"hljs-attribute\\\">sourceAnchor</span>: <span class=\\\"hljs-number\\\">0</span>,       <span class=\\\"hljs-comment\\\">// 源节点锚点（以上锚点测试为填写后将不会与其他点连接，具体作用未知）</span>\\n  <span class=\\\"hljs-attribute\\\">targetAnchor</span>: <span class=\\\"hljs-number\\\">2</span>,       <span class=\\\"hljs-comment\\\">// 目标节点锚点（以上锚点测试为填写后将不会与其他点连接，具体作用未知）</span>\\n  <span class=\\\"hljs-attribute\\\">color</span>: <span class=\\\"hljs-string\\\">'red'</span>,          <span class=\\\"hljs-comment\\\">// 颜色</span>\\n  <span class=\\\"hljs-attribute\\\">size</span>: <span class=\\\"hljs-number\\\">3</span>,               <span class=\\\"hljs-comment\\\">// 尺寸</span>\\n  <span class=\\\"hljs-attribute\\\">shape</span>: <span class=\\\"hljs-string\\\">'line'</span>,         <span class=\\\"hljs-comment\\\">// 所用图形（目前只测验了line可用）, 引入插件-二阶贝塞尔曲线 ， 可使用shape: quadraticCurve</span>\\n  <span class=\\\"hljs-attribute\\\">style</span>: {               <span class=\\\"hljs-comment\\\">// 关键形样式（优先级高于color）</span>\\n      <span class=\\\"hljs-attribute\\\">stroke</span>: <span class=\\\"hljs-string\\\">'blue'</span>\\n  },\\n  <span class=\\\"hljs-attribute\\\">label</span>: <span class=\\\"hljs-string\\\">'文本标签'</span> || {   <span class=\\\"hljs-comment\\\">// 文本标签 || 文本图形配置</span>\\n    <span class=\\\"hljs-attribute\\\">text</span>: <span class=\\\"hljs-string\\\">'文本标签'</span>,\\n      <span class=\\\"hljs-attribute\\\">fill</span>: <span class=\\\"hljs-string\\\">'green'</span>\\n  },\\n  <span class=\\\"hljs-attribute\\\">parent</span>: <span class=\\\"hljs-string\\\">'group1'</span>,       <span class=\\\"hljs-comment\\\">// 所属组</span>\\n  <span class=\\\"hljs-attribute\\\">index</span>: <span class=\\\"hljs-number\\\">1</span>,               <span class=\\\"hljs-comment\\\">// 渲染层级</span>\\n}\\n</code></pre>\\n<p>groups：群组的数据模型</p>\\n<pre><code class=\\\"lang-javascript\\\">{\\n  <span class=\\\"hljs-attribute\\\">id</span>: <span class=\\\"hljs-string\\\">'group1'</span>,             <span class=\\\"hljs-comment\\\">// id 必须唯一</span>\\n  <span class=\\\"hljs-attribute\\\">color</span>: <span class=\\\"hljs-string\\\">'#333'</span>,           <span class=\\\"hljs-comment\\\">// 颜色</span>\\n  <span class=\\\"hljs-attribute\\\">size</span>: <span class=\\\"hljs-number\\\">10</span> || [<span class=\\\"hljs-number\\\">10</span>, <span class=\\\"hljs-number\\\">10</span>],    <span class=\\\"hljs-comment\\\">// 尺寸 || [宽, 高], 参数不可用</span>\\n  <span class=\\\"hljs-attribute\\\">shape</span>: <span class=\\\"hljs-string\\\">'circle'</span>,         <span class=\\\"hljs-comment\\\">// 所用图形, 参数不可用</span>\\n  <span class=\\\"hljs-attribute\\\">style</span>: {                 <span class=\\\"hljs-comment\\\">// 关键形样式（优先级高于color）</span>\\n    <span class=\\\"hljs-attribute\\\">fill</span>: <span class=\\\"hljs-string\\\">'red'</span>,\\n      <span class=\\\"hljs-attribute\\\">stroke</span>: <span class=\\\"hljs-string\\\">'blue'</span>\\n  },\\n  <span class=\\\"hljs-attribute\\\">label</span>: <span class=\\\"hljs-string\\\">'文本标签'</span> || {     <span class=\\\"hljs-comment\\\">// 文本标签 || 文本图形配置</span>\\n    <span class=\\\"hljs-attribute\\\">text</span>: <span class=\\\"hljs-string\\\">'文本标签'</span>,\\n      <span class=\\\"hljs-attribute\\\">fill</span>: <span class=\\\"hljs-string\\\">'green'</span>\\n  },\\n  <span class=\\\"hljs-attribute\\\">parent</span>: <span class=\\\"hljs-string\\\">'group2'</span>,         <span class=\\\"hljs-comment\\\">// 所属组</span>\\n  <span class=\\\"hljs-attribute\\\">index</span>: <span class=\\\"hljs-number\\\">1</span>,                 <span class=\\\"hljs-comment\\\">// 渲染层级</span>\\n}\\n</code></pre>\\n<p>roots: type 为 tree 时, data 数据模型</p>\\n<pre><code class=\\\"lang-javascript\\\">[\\n  {\\n    id: <span class=\\\"hljs-string\\\">'root'</span>, <span class=\\\"hljs-comment\\\">// 根节点 id</span>\\n    <span class=\\\"hljs-built_in\\\">color</span>: <span class=\\\"hljs-string\\\">'#333'</span>, <span class=\\\"hljs-comment\\\">// 颜色</span>\\n    <span class=\\\"hljs-built_in\\\">size</span>: <span class=\\\"hljs-number\\\">10</span> || [<span class=\\\"hljs-number\\\">10</span>, <span class=\\\"hljs-number\\\">10</span>], <span class=\\\"hljs-comment\\\">// 尺寸 || [宽, 高]</span>\\n    <span class=\\\"hljs-built_in\\\">shape</span>: <span class=\\\"hljs-string\\\">'circle'</span>, <span class=\\\"hljs-comment\\\">//  所用图形</span>\\n    style: {\\n      <span class=\\\"hljs-comment\\\">// 样式 (优先级高于 color)</span>\\n      <span class=\\\"hljs-built_in\\\">fill</span>: <span class=\\\"hljs-string\\\">'red'</span>,\\n      <span class=\\\"hljs-built_in\\\">stroke</span>: <span class=\\\"hljs-string\\\">'blue'</span>,\\n    },\\n    label: <span class=\\\"hljs-string\\\">'文本标签'</span> || {\\n      <span class=\\\"hljs-comment\\\">// 文本标签 || 文本图形配置</span>\\n      <span class=\\\"hljs-built_in\\\">text</span>: <span class=\\\"hljs-string\\\">'文本标签'</span>,\\n      <span class=\\\"hljs-built_in\\\">fill</span>: <span class=\\\"hljs-string\\\">'green'</span>,\\n    },\\n    parent: <span class=\\\"hljs-string\\\">'parentId'</span>, <span class=\\\"hljs-comment\\\">// 父节点 id</span>\\n    collapsed: <span class=\\\"hljs-keyword\\\">false</span>, <span class=\\\"hljs-comment\\\">// 是否折叠 默认false</span>\\n    index: <span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-comment\\\">// 渲染层级</span>\\n    children: [\\n      {\\n        <span class=\\\"hljs-comment\\\">// 子元素集 （子元素数据模型和根节点同构）</span>\\n        id: <span class=\\\"hljs-string\\\">'leaf'</span>,\\n      },\\n    ],\\n  },\\n];\\n</code></pre>\\n<h4 id=\\\"container\\\">container</h4>\\n<p>需传入 dom 容器或者容器 id {domObject || string}  必选</p>\\n<h4 id=\\\"width\\\">width</h4>\\n<p>画布宽，单位像素 {number}  可选</p>\\n<h4 id=\\\"height\\\">height</h4>\\n<p>画布高，单位像素 {number}  可选</p>\\n<h4 id=\\\"fitview\\\">fitview</h4>\\n<p>初始化视口区域  {string}  可选\\n候选值为： &#39;tl&#39;, &#39;lc&#39;, &#39;bl&#39;, &#39;cc&#39;, &#39;tc&#39;, &#39;tr&#39;, &#39;rc&#39;, &#39;br&#39;, &#39;bc&#39;, &#39;autoZoom&#39;</p>\\n<p><img src=\\\"//cdn.nlark.com/lark/0/2018/png/124533/1532954651334-8286b350-7e04-4b56-84ec-fc0182e1bf32.png\\\" width=\\\"300px\\\"/></p>\\n<h4 id=\\\"fitviewpadding\\\">fitViewPadding</h4>\\n<p>视口适应画布边距 {boolean | number | number[]}  可选\\n<img src=\\\"//cdn.nlark.com/lark/0/2018/png/1140/1533632218107-1822dab0-9499-41cb-8fb4-cfb4843637ec.png\\\" width=\\\"300px\\\"/></p>\\n<h4 id=\\\"animate\\\">animate</h4>\\n<p>是否开启动画 {boolean} 默认 false</p>\\n<h4 id=\\\"minzoom\\\">minZoom</h4>\\n<p>最小缩放倍率 {number} 默认为 0.2</p>\\n<h4 id=\\\"maxzoom\\\">maxZoom</h4>\\n<p>最大缩放倍率 {number} 默认为 10</p>\\n<h4 id=\\\"plugins\\\">plugins</h4>\\n<p>插件集 {array} 用于扩展 layout 或者映射关系，示例如下</p>\\n<pre><code><span class=\\\"hljs-comment\\\">// 插件-布局-阿基米德螺线</span>\\n<span class=\\\"hljs-keyword\\\">var</span> <span class=\\\"hljs-keyword\\\">Plugin</span> = G6.Plugins[<span class=\\\"hljs-string\\\">\\\"layout.circle\\\"</span>];\\n<span class=\\\"hljs-comment\\\">// 插件-布局-圆形</span>\\n<span class=\\\"hljs-keyword\\\">var</span> <span class=\\\"hljs-keyword\\\">Plugin</span> = G6.Plugins[<span class=\\\"hljs-string\\\">\\\"layout.archimeddeanSpiral\\\"</span>];\\n<span class=\\\"hljs-comment\\\">// 插件-模版-最大生成森林</span>\\n<span class=\\\"hljs-keyword\\\">var</span> <span class=\\\"hljs-keyword\\\">Plugin</span> = G6.Plugins[<span class=\\\"hljs-string\\\">\\\"template.maxSpanningForest\\\"</span>];\\n<span class=\\\"hljs-comment\\\">// 插件-缩略图</span>\\n<span class=\\\"hljs-keyword\\\">var</span> <span class=\\\"hljs-keyword\\\">Plugin</span> = G6.Plugins[<span class=\\\"hljs-string\\\">\\\"tool.minimap\\\"</span>];\\n<span class=\\\"hljs-keyword\\\">var</span> <span class=\\\"hljs-keyword\\\">plugin</span> = new <span class=\\\"hljs-keyword\\\">Plugin</span>({\\n  container: 'minimap',\\n  width: 180,\\n  height: 120\\n});\\n\\n<span class=\\\"hljs-keyword\\\">var</span> <span class=\\\"hljs-keyword\\\">graph</span> = new G6.<span class=\\\"hljs-keyword\\\">Graph</span>({\\n  container: 'mountNode',\\n  fitView: '<span class=\\\"hljs-keyword\\\">cc</span>',\\n  height: <span class=\\\"hljs-keyword\\\">window</span>.innerHeight,\\n  plugins: [new <span class=\\\"hljs-keyword\\\">Plugin</span>()]\\n});\\n</code></pre><h4 id=\\\"layout\\\">layout</h4>\\n<p>布局参数 {object|function}\\n详见方法中的 layouts</p>\\n<h4 id=\\\"-\\\">事件</h4>\\n<pre><code class=\\\"lang-javascript\\\"><span class=\\\"hljs-keyword\\\">const</span> graph = {\\n  <span class=\\\"hljs-attr\\\">type</span>: <span class=\\\"hljs-string\\\">'graph'</span>,\\n  data,\\n  <span class=\\\"hljs-attr\\\">onClick</span>: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">ev, graph</span>) </span>{\\n    <span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'click'</span>, ev, graph);\\n  },\\n};\\n</code></pre>\\n<pre><code>  onClick?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 鼠标单击</span>\\n  onAfterchange?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 数据改变后</span>\\n  onMousedown?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 鼠标按下</span>\\n  onMousemove?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 鼠标移动</span>\\n  onMouseleave?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 鼠标离开画布区域</span>\\n  onMouseup?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 鼠标抬起</span>\\n  onDblclick?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 鼠标双击</span>\\n  onTouchstart?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 手指触摸</span>\\n  onTouchmove?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 手指移动</span>\\n  onTouchend?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 手指离开</span>\\n  onPlotenter?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 进入图表时</span>\\n  onPlotmove?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 在图表上移动时</span>\\n  onPlotleave?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 从图表离开时</span>\\n  onPlotclick?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 单击图表时</span>\\n  onPlotdblclick?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 双击图表时</span>\\n  onDragstart?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 开始拖动时</span>\\n  onDrag?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 拖动中</span>\\n  onDragend?: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">func</span>; 拖动结束时</span>\\n</code></pre><h4 id=\\\"-\\\">事件回调函数参数</h4>\\n<p>ev: dom 节点相关信息\\ngraph: 配置参数相关信息</p>\\n<h3 id=\\\"zoom-\\\">zoom 画布缩放</h3>\\n<h4 id=\\\"min-number-\\\">min?: number;</h4>\\n<p>最小缩放比率</p>\\n<h4 id=\\\"max-number-\\\">max?: number;</h4>\\n<p>最大缩放比率</p>\\n<h4 id=\\\"current-number-\\\">current?: number;</h4>\\n<p>当前缩放比率</p>\\n<pre><code class=\\\"lang-javascript\\\"><span class=\\\"hljs-keyword\\\">const</span> zoom = {\\n  <span class=\\\"hljs-attr\\\">max</span>: <span class=\\\"hljs-number\\\">10</span>,\\n  <span class=\\\"hljs-attr\\\">min</span>: <span class=\\\"hljs-number\\\">1</span>,\\n  <span class=\\\"hljs-attr\\\">current</span>: <span class=\\\"hljs-number\\\">2</span>,\\n};\\n<span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-keyword\\\">default</span> <span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">class</span> <span class=\\\"hljs-title\\\">App</span> <span class=\\\"hljs-keyword\\\">extends</span> <span class=\\\"hljs-title\\\">React</span>.<span class=\\\"hljs-title\\\">Component</span> </span>{\\n  <span class=\\\"hljs-keyword\\\">constructor</span>(props) {\\n    <span class=\\\"hljs-keyword\\\">super</span>(props);\\n  }\\n  render() {\\n    <span class=\\\"hljs-keyword\\\">return</span> (\\n      <span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">div</span>&gt;</span>\\n        <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Graph</span> {<span class=\\\"hljs-attr\\\">...graph</span>}&gt;</span>\\n          <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Zoom</span> {<span class=\\\"hljs-attr\\\">...zoom</span>} /&gt;</span>\\n        <span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">Graph</span>&gt;</span>\\n      <span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">div</span>&gt;</span>\\n    );\\n  }\\n}</span>\\n</code></pre>\\n<h3 id=\\\"node\\\">Node</h3>\\n<h4 id=\\\"shape-string-\\\">shape?: string;</h4>\\n<p>节点形状</p>\\n<h4 id=\\\"size-number-\\\">size?: number;</h4>\\n<p>节点大小</p>\\n<h4 id=\\\"label-obj-any-\\\">label?: (obj: any) =&gt; {};</h4>\\n<p>节点文本</p>\\n<h4 id=\\\"style-any-\\\">style?: any;</h4>\\n<p>节点样式</p>\\n<pre><code class=\\\"lang-javascript\\\"><span class=\\\"hljs-keyword\\\">const</span> node = {\\n  <span class=\\\"hljs-attr\\\">shape</span>: <span class=\\\"hljs-string\\\">'treeNode'</span>,\\n  <span class=\\\"hljs-attr\\\">size</span>: <span class=\\\"hljs-number\\\">8</span>,\\n  <span class=\\\"hljs-attr\\\">label</span>: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">obj</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> obj.name;\\n  },\\n  <span class=\\\"hljs-attr\\\">style</span>: {\\n    <span class=\\\"hljs-attr\\\">fill</span>: <span class=\\\"hljs-string\\\">'red'</span>,\\n    <span class=\\\"hljs-attr\\\">stroke</span>: <span class=\\\"hljs-string\\\">'blue'</span>,\\n  },\\n};\\n<span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-keyword\\\">default</span> <span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">class</span> <span class=\\\"hljs-title\\\">App</span> <span class=\\\"hljs-keyword\\\">extends</span> <span class=\\\"hljs-title\\\">React</span>.<span class=\\\"hljs-title\\\">Component</span> </span>{\\n  <span class=\\\"hljs-keyword\\\">constructor</span>(props) {\\n    <span class=\\\"hljs-keyword\\\">super</span>(props);\\n  }\\n  render() {\\n    <span class=\\\"hljs-keyword\\\">return</span> (\\n      <span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">div</span>&gt;</span>\\n        <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Graph</span> {<span class=\\\"hljs-attr\\\">...graph</span>}&gt;</span>\\n          <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Node</span> {<span class=\\\"hljs-attr\\\">...node</span>} /&gt;</span>\\n        <span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">Graph</span>&gt;</span>\\n      <span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">div</span>&gt;</span>\\n    );\\n  }\\n}</span>\\n</code></pre>\\n<h3 id=\\\"edge\\\">Edge</h3>\\n<h4 id=\\\"shape-string-\\\">shape?: string;边形状</h4>\\n<h4 id=\\\"style-any-\\\">style?: any;边样式</h4>\\n<pre><code class=\\\"lang-javascript\\\"><span class=\\\"hljs-keyword\\\">const</span> edge = {\\n  <span class=\\\"hljs-attr\\\">shape</span>: <span class=\\\"hljs-string\\\">'smooth'</span>,\\n  <span class=\\\"hljs-attr\\\">style</span>: {\\n    <span class=\\\"hljs-attr\\\">stroke</span>: <span class=\\\"hljs-string\\\">'blue'</span>,\\n  },\\n};\\n<span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-keyword\\\">default</span> <span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">class</span> <span class=\\\"hljs-title\\\">App</span> <span class=\\\"hljs-keyword\\\">extends</span> <span class=\\\"hljs-title\\\">React</span>.<span class=\\\"hljs-title\\\">Component</span> </span>{\\n  <span class=\\\"hljs-keyword\\\">constructor</span>(props) {\\n    <span class=\\\"hljs-keyword\\\">super</span>(props);\\n  }\\n  render() {\\n    <span class=\\\"hljs-keyword\\\">return</span> (\\n      <span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">div</span>&gt;</span>\\n        <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Graph</span> {<span class=\\\"hljs-attr\\\">...graph</span>}&gt;</span>\\n          <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Edge</span> {<span class=\\\"hljs-attr\\\">...Edge</span>} /&gt;</span>\\n        <span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">Graph</span>&gt;</span>\\n      <span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">div</span>&gt;</span>\\n    );\\n  }\\n}</span>\\n</code></pre>\\n<p>详细可见： <a href=\\\"https://antv.alipay.com/zh-cn/g6/1.x/api/graph.html\\\">https://antv.alipay.com/zh-cn/g6/1.x/api/graph.html</a></p>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/api/graphApi/cn.md?");

