eval("module.exports = \"<h1 id=\\\"chart\\\">Chart</h1>\\n<p>The Chart component generates a chart instance inside, which contains loading and updating of many sub components.</p>\\n<h1 id=\\\"api\\\">API</h1>\\n<h3 id=\\\"height-number-\\\">height?: number;</h3>\\n<ul>\\n<li>Description: Specifies the height of the chart, in the form of &#39;px&#39;.</li>\\n</ul>\\n<h3 id=\\\"width-number-\\\">width?: number;</h3>\\n<ul>\\n<li>Description: Specifies the width of the chart, in the form of &#39;px&#39;,the width is not effective when forceFit is true.</li>\\n</ul>\\n<h3 id=\\\"animate-boolean-object-\\\">animate?: boolean | object;</h3>\\n<ul>\\n<li>Description: The graphic animation switch is true by default, that is to open animation.</li>\\n</ul>\\n<h3 id=\\\"forcefit-boolean-\\\">forceFit?: boolean;</h3>\\n<ul>\\n<li>Description: The width self-adapting switch of the chart, which defaults to false, is set to true to indicate the width of the automatic DOM (instance container).</li>\\n</ul>\\n<h3 id=\\\"background-ibackground-\\\">background?: IBackground;</h3>\\n<ul>\\n<li>Description: Set the overall frame and background style of the chart,the type of that is a object,</li>\\n</ul>\\n<p>Object type IBackground</p>\\n<pre><code><span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">interface</span> <span class=\\\"hljs-title\\\">IBackground</span> {</span>\\n  stroke?: string;\\n  strokeOpacity?: number;\\n  lineWidth?: number;\\n  fill?: string;\\n  fillOpactiy?: number;\\n  radius?: number;\\n}\\n</code></pre><h3 id=\\\"plotbackground-ibackground-\\\">plotBackground?: IBackground;</h3>\\n<ul>\\n<li>Description: The border and background styles of the chart drawing area,the type of that is a object,</li>\\n</ul>\\n<p>Object type IBackground</p>\\n<pre><code><span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">interface</span> <span class=\\\"hljs-title\\\">IBackground</span> {</span>\\n  stroke?: string;\\n  strokeOpacity?: number;\\n  lineWidth?: number;\\n  fill?: string;\\n  fillOpactiy?: number;\\n  radius?: number;\\n}\\n</code></pre><h3 id=\\\"padding-number-object-number-string-\\\">padding?: number | object | number[] | string;</h3>\\n<ul>\\n<li>Description: Chart paddings,which has the following configuration format.</li>\\n</ul>\\n<p>The usage methods is similar as CSS box models when padding is numbers or array type.</p>\\n<p>Borders are automatically computed when &#39;auto&#39;is present in padding, and only the borders occupied by axis and legend are currently considered.</p>\\n<p>Examples:</p>\\n<pre><code><span class=\\\"hljs-string\\\">padding:</span> [ <span class=\\\"hljs-number\\\">20</span>, <span class=\\\"hljs-number\\\">30</span>, <span class=\\\"hljs-number\\\">20</span>, <span class=\\\"hljs-number\\\">30</span>]\\n<span class=\\\"hljs-string\\\">padding:</span> <span class=\\\"hljs-number\\\">20</span>\\n<span class=\\\"hljs-string\\\">padding:</span> { <span class=\\\"hljs-string\\\">top:</span> <span class=\\\"hljs-number\\\">20</span>, <span class=\\\"hljs-string\\\">right:</span> <span class=\\\"hljs-number\\\">30</span>, <span class=\\\"hljs-string\\\">bottom:</span> <span class=\\\"hljs-number\\\">20</span>, <span class=\\\"hljs-string\\\">left:</span> <span class=\\\"hljs-number\\\">30</span> }\\n<span class=\\\"hljs-string\\\">padding:</span> <span class=\\\"hljs-string\\\">'auto'</span>\\n<span class=\\\"hljs-string\\\">padding:</span> [<span class=\\\"hljs-number\\\">20</span>, <span class=\\\"hljs-string\\\">'auto'</span>, <span class=\\\"hljs-number\\\">30</span>, <span class=\\\"hljs-string\\\">'auto'</span>] <span class=\\\"hljs-comment\\\">// not support temporary</span>\\n\\n</code></pre><p>Setting percentages, such as padding: [20%&#39;, 30%], are not supported for the time being, which is relative to the width of the entire chart.</p>\\n<h3 id=\\\"theme-string-\\\">theme?: string;</h3>\\n<ul>\\n<li>Description: theme, At present,&#39;default&#39; and &#39;dark&#39; are supported, and new theme can be registered by registration.</li>\\n</ul>\\n<h3 id=\\\"renderer-string-\\\">renderer?: string;</h3>\\n<ul>\\n<li>Description: Specifies the rendering mode of the chart, starting with viser 3.2, and supporting chart level using SVG rendering.\\nDefault value: canvas, optional value svg.</li>\\n</ul>\\n<p>Examples:</p>\\n<pre><code><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Chart</span> <span class=\\\"hljs-attr\\\">height</span>=<span class=\\\"hljs-string\\\">{400}</span> <span class=\\\"hljs-attr\\\">data</span>=<span class=\\\"hljs-string\\\">{data}</span> <span class=\\\"hljs-attr\\\">renderer</span>=<span class=\\\"hljs-string\\\">'svg'</span> /&gt;</span>\\n</code></pre><h3 id=\\\"data\\\">data</h3>\\n<ul>\\n<li>Type: Array/DataSet</li>\\n<li>Description: Set the data source for the chart. Data is an array or DataSet.View object that contains JSON objects.</li>\\n</ul>\\n<h3 id=\\\"scale\\\">scale</h3>\\n<ul>\\n<li>Type: Object</li>\\n<li>Description: Configure the data scale, which will affect the way the data is displayed in the chart.</li>\\n</ul>\\n<h3 id=\\\"event\\\">event</h3>\\n<p>Transfer parameter (ev: any, chart: any) =&gt; void</p>\\n<h4 id=\\\"onmousedown\\\">onMouseDown</h4>\\n<h4 id=\\\"onmousemove\\\">onMouseMove</h4>\\n<h4 id=\\\"onmouseleave\\\">onMouseLeave</h4>\\n<h4 id=\\\"onmouseup\\\">onMouseUp</h4>\\n<h4 id=\\\"onclick\\\">onClick</h4>\\n<h4 id=\\\"ondbclick\\\">onDbClick</h4>\\n<h4 id=\\\"ontouchstart\\\">onTouchStart</h4>\\n<h4 id=\\\"ontouchmove\\\">onTouchMove</h4>\\n<h4 id=\\\"ontouchend\\\">onTouchEnd</h4>\\n<h4 id=\\\"onplotenter\\\">onPlotEnter</h4>\\n<h4 id=\\\"onplotmove\\\">onPlotMove</h4>\\n<h4 id=\\\"onplotleave\\\">onPlotLeave</h4>\\n<h4 id=\\\"onplotclick\\\">onPlotClick</h4>\\n<h4 id=\\\"onplotdbclick\\\">onPlotDbClick</h4>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/api/viserChart/en.md?");

