eval("module.exports = \"<h1 id=\\\"coord\\\">Coord</h1>\\n<p>坐标系组件。 坐标系是将两种位置标度结合在一起组成的 2 维定位系统，描述了数据是如何映射到图形所在的平面。坐标系抽象为组件，并且包含两种类型坐标系极坐标系（polar、theta、helix 均属于极坐标）和笛卡尔坐标系，目前所有的坐标系均是 2 维的。</p>\\n<h1 id=\\\"api\\\">API</h1>\\n<p>坐标系组件分为两类直角坐标系、极坐标系。两者的 api 是不同的。详细如下：</p>\\n<pre><code><span class=\\\"hljs-comment\\\">// 直角坐标系</span>\\n<span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">interface</span> <span class=\\\"hljs-title\\\">IRectCoord</span> {</span>\\n  type?: <span class=\\\"hljs-string\\\">'rect'</span>;\\n  direction?: string;\\n}\\n\\n<span class=\\\"hljs-comment\\\">// 极坐标系</span>\\n<span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">interface</span> <span class=\\\"hljs-title\\\">IPolarCoord</span> {</span>\\n  type?: <span class=\\\"hljs-string\\\">'polar'</span> | <span class=\\\"hljs-string\\\">'theta'</span> | <span class=\\\"hljs-string\\\">'helix'</span>;\\n  direction?: string;\\n  radius?: number;\\n  innerRadius?: number;\\n  startAngle?: number;\\n  endAngle?: number;\\n}\\n</code></pre><h3 id=\\\"type-polar-theta-helix-rect-\\\">type?: &#39;polar&#39; | &#39;theta&#39; | &#39;helix&#39; | &#39;rect&#39;;</h3>\\n<ul>\\n<li>描述：坐标系类型不同类型的坐标系所支持的配置属性也不一样。具体见各类型属性说明。</li>\\n</ul>\\n<p>支持的坐标系有：</p>\\n<table>\\n<thead>\\n<tr>\\n<th>类型</th>\\n<th>说明</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>rect</td>\\n<td>默认类型，直角坐标系，由 x, y 两个垂直的维度构成。</td>\\n</tr>\\n<tr>\\n<td>polar</td>\\n<td>极坐标系，由角度和半径 2 个维度构成。</td>\\n</tr>\\n<tr>\\n<td>theta</td>\\n<td>一种半径固定的极坐标系，常用于饼图。</td>\\n</tr>\\n<tr>\\n<td>helix</td>\\n<td>螺旋坐标系，基于阿基米德螺旋线。</td>\\n</tr>\\n</tbody>\\n</table>\\n<h3 id=\\\"direction-string-\\\">direction?: string;</h3>\\n<ul>\\n<li>描述：根据常见坐标系进行分类。</li>\\n</ul>\\n<p>直角坐标系映射关系如下：</p>\\n<table>\\n<thead>\\n<tr>\\n<th style=\\\"text-align:left\\\">direction</th>\\n<th style=\\\"text-align:left\\\">配置</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td style=\\\"text-align:left\\\">BL(默认）</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">BR</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).scale(-1, 1);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">LT</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose().scale(1, -1);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">LB</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose();</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">RB</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose().reflect();</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">RT</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose().reflect().scale(-1, 1);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">TL</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect();</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">TR</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect().scale(-1, 1);</td>\\n</tr>\\n</tbody>\\n</table>\\n<p>同理，对于极坐标系我们也提供了 4 种方向，最主要是 <code>rotate</code> 和 <code>reverse</code> 两种，具体映射关系如下：</p>\\n<table>\\n<thead>\\n<tr>\\n<th style=\\\"text-align:left\\\">direction</th>\\n<th style=\\\"text-align:left\\\">配置</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td style=\\\"text-align:left\\\">rotate</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose();</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">xReverse</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect(&#39;x&#39;);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">yReverse</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect(&#39;y&#39;);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">reverse</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect();</td>\\n</tr>\\n</tbody>\\n</table>\\n<h3 id=\\\"radius-number-\\\">radius?: number;</h3>\\n<ul>\\n<li>描述：设置半径，值范围为 0 至 1</li>\\n</ul>\\n<h3 id=\\\"innerradius-number-\\\">innerRadius?: number;</h3>\\n<ul>\\n<li>描述：空心圆的半径，值范围为 0 至 1</li>\\n</ul>\\n<h3 id=\\\"startangle-number-\\\">startAngle?: number;</h3>\\n<ul>\\n<li>描述：极坐标的起始角度，单位为弧度</li>\\n</ul>\\n<h3 id=\\\"endangle-number-\\\">endAngle?: number;</h3>\\n<ul>\\n<li>描述：极坐标的结束角度，单位为弧度</li>\\n</ul>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/api/viserCoord/cn.md?");

