eval("module.exports = \"<h1 id=\\\"coord\\\">Coord</h1>\\n<p>The Coord components. Coordinate systems is a 2-D positioning system which combines two position scales and describes how the data is mapped to the plane where the graph is located. Coordinate systems is abstracted as a component and contains two types of polar coordinate systems (polar, theta, helix belong to polar coordinates) and Cartesian coordinate systems. At present, all coordinate systems are 2-dimensional.</p>\\n<h1 id=\\\"api\\\">API</h1>\\n<p>The Coord components are divided into two types: rectangular coordinate system and polar coordinate system. The API of the two is different. The details are as follows:</p>\\n<pre><code><span class=\\\"hljs-comment\\\">// Rectangular coordinate system</span>\\n<span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">interface</span> <span class=\\\"hljs-title\\\">IRectCoord</span> {</span>\\n  type?: <span class=\\\"hljs-string\\\">'rect'</span>;\\n  direction?: string;\\n}\\n\\n<span class=\\\"hljs-comment\\\">// Polar coordinate system</span>\\n<span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">interface</span> <span class=\\\"hljs-title\\\">IPolarCoord</span> {</span>\\n  type?: <span class=\\\"hljs-string\\\">'polar'</span> | <span class=\\\"hljs-string\\\">'theta'</span> | <span class=\\\"hljs-string\\\">'helix'</span>;\\n  direction?: string;\\n  radius?: number;\\n  innerRadius?: number;\\n  startAngle?: number;\\n  endAngle?: number;\\n}\\n</code></pre><h3 id=\\\"type-polar-theta-helix-rect-\\\">type?: &#39;polar&#39; | &#39;theta&#39; | &#39;helix&#39; | &#39;rect&#39;;</h3>\\n<ul>\\n<li>Description: The coordinate systems supported by different types of coordinate systems have different configuration properties. See specific types of property descriptions.</li>\\n</ul>\\n<p>The supporting coordinate systems are:</p>\\n<table>\\n<thead>\\n<tr>\\n<th>Type</th>\\n<th>Illustration</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>rect</td>\\n<td>default,rectangular coordinate system,which consists of two vertical dimensions, X and Y.</td>\\n</tr>\\n<tr>\\n<td>polar</td>\\n<td>polar coordinate system,which consists of 2 dimensions: angle and radius.</td>\\n</tr>\\n<tr>\\n<td>theta</td>\\n<td>a polar coordinate system with fixed radius, commonly used in pie charts.</td>\\n</tr>\\n<tr>\\n<td>helix</td>\\n<td>the spiral coordinate system which is based on Archimedes helix.</td>\\n</tr>\\n</tbody>\\n</table>\\n<h3 id=\\\"direction-string-\\\">direction?: string;</h3>\\n<ul>\\n<li>Description: Classified according to common coordinate system.</li>\\n</ul>\\n<p>The mapping relations in rectangular coordinates are as follows:</p>\\n<table>\\n<thead>\\n<tr>\\n<th style=\\\"text-align:left\\\">direction</th>\\n<th style=\\\"text-align:left\\\">config</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td style=\\\"text-align:left\\\">BL(default)</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">BR</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).scale(-1, 1);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">LT</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose().scale(1, -1);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">LB</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose();</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">RB</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose().reflect();</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">RT</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose().reflect().scale(-1, 1);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">TL</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect();</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">TR</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect().scale(-1, 1);</td>\\n</tr>\\n</tbody>\\n</table>\\n<p>Similarly, we also provide four directions for polar coordinate systems, the most important of which are <code>rotate</code> and <code>reverse</code>. The mapping relations are as follows:</p>\\n<table>\\n<thead>\\n<tr>\\n<th style=\\\"text-align:left\\\">direction</th>\\n<th style=\\\"text-align:left\\\">config</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td style=\\\"text-align:left\\\">rotate</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose();</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">xReverse</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect(&#39;x&#39;);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">yReverse</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect(&#39;y&#39;);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">reverse</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect();</td>\\n</tr>\\n</tbody>\\n</table>\\n<h3 id=\\\"radius-number-\\\">radius?: number;</h3>\\n<ul>\\n<li>Description: Set the radius range from 0 to 1.</li>\\n</ul>\\n<h3 id=\\\"innerradius-number-\\\">innerRadius?: number;</h3>\\n<ul>\\n<li>Description: The radius of a hollow circle ranges from 0 to 1.</li>\\n</ul>\\n<h3 id=\\\"startangle-number-\\\">startAngle?: number;</h3>\\n<ul>\\n<li>Description: The starting angle of polar coordinates is radian.</li>\\n</ul>\\n<h3 id=\\\"endangle-number-\\\">endAngle?: number;</h3>\\n<ul>\\n<li>Description: The ending angle of polar coordinates is radian.</li>\\n</ul>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/api/viserCoord/en.md?");

