eval("module.exports = \"<h1 id=\\\"facet\\\">Facet</h1>\\n<p>Facet, which separate data into several subsets according to a certain dimension, and then a graph matrix is created to draw each subset of data into the pane of the graph matrix.</p>\\n<p>To sum up, facet actually provides two functions:</p>\\n<p>Partitioning data sets according to the specified dimensions;\\nTypesetting charts.</p>\\n<p>For exploratory data analysis, faceting is a powerful tool that can help you quickly analyze the similarities and differences of data subset patterns.</p>\\n<h1 id=\\\"api\\\">API</h1>\\n<h3 id=\\\"type-string-\\\">type: string;</h3>\\n<ul>\\n<li>Description: Facet type : &#39;rect&#39; | &#39;list&#39; | &#39;circle&#39; | &#39;tree&#39; | &#39;mirror&#39;.</li>\\n</ul>\\n<p>The supporting facet type is shown in the following table:</p>\\n<table>\\n<thead>\\n<tr>\\n<th>Facet type</th>\\n<th>Instruction</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>rect</td>\\n<td>default, 2 dimensions are specified to form the matrix of the chart</td>\\n</tr>\\n<tr>\\n<td>list</td>\\n<td>Specifies a dimension that specifies that a row has several columns, which are beyond the line wrap</td>\\n</tr>\\n<tr>\\n<td>circle</td>\\n<td>Specify a dimension that is distributed along the circle</td>\\n</tr>\\n<tr>\\n<td>tree</td>\\n<td>Multiple dimensions are specified, and each dimension is expanded as a tree level</td>\\n</tr>\\n<tr>\\n<td>mirror</td>\\n<td>Specify a dimension to form a mirror chart</td>\\n</tr>\\n<tr>\\n<td>matrix</td>\\n<td>Specify a dimension to form the matrix facet</td>\\n</tr>\\n</tbody>\\n</table>\\n<h3 id=\\\"fields-string-\\\">fields?: string[];</h3>\\n<ul>\\n<li>Description: Setting the dimension of data partitioning is the field name of the data, which is imported by array when containing multiple dimensions. The number of incoming fields of different type is different.</li>\\n</ul>\\n<h3 id=\\\"cols-number-\\\">cols?: number;</h3>\\n<ul>\\n<li>Description: Specifies that each row can display the number of facets and automatically wrap when it exceeds.</li>\\n</ul>\\n<h3 id=\\\"rows-number-\\\">rows?: number;</h3>\\n<ul>\\n<li>Description: Specifies that each col can display the number of facets and automatically wrap when it exceeds.</li>\\n</ul>\\n<h3 id=\\\"colfield-string-string-\\\">colField?: string | string[];</h3>\\n<ul>\\n<li>Description: </li>\\n</ul>\\n<h3 id=\\\"rowfield-string-string-\\\">rowField?: string | string[];</h3>\\n<ul>\\n<li>Description: </li>\\n</ul>\\n<h3 id=\\\"colvalue-number-\\\">colValue?: number;</h3>\\n<ul>\\n<li>Description: </li>\\n</ul>\\n<h3 id=\\\"rowvalue-number-\\\">rowValue?: number;</h3>\\n<ul>\\n<li>Description: </li>\\n</ul>\\n<h3 id=\\\"colindex-number-\\\">colIndex?: number;</h3>\\n<ul>\\n<li>Description: The index of cols</li>\\n</ul>\\n<h3 id=\\\"rowindex-number-\\\">rowIndex?: number;</h3>\\n<ul>\\n<li>Description: The index of rows</li>\\n</ul>\\n<h3 id=\\\"showtitle-boolean-\\\">showTitle?: boolean;</h3>\\n<ul>\\n<li>Description: Whether show title or not</li>\\n</ul>\\n<h3 id=\\\"coltitle-icoltitleprops-\\\">colTitle?: IColTitleProps;</h3>\\n<ul>\\n<li>Description: The title of the col</li>\\n</ul>\\n<pre><code><span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">interface</span> <span class=\\\"hljs-title\\\">IColTitleProps</span> {</span>\\n  offsetY?: number;\\n  style?: IStyle.ITextStyle;\\n}\\n</code></pre><h3 id=\\\"rowtitle-irowtitleprops-\\\">rowTitle?: IRowTitleProps;</h3>\\n<ul>\\n<li>Description: The title of the row</li>\\n</ul>\\n<pre><code><span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">interface</span> <span class=\\\"hljs-title\\\">IRowTitleProps</span> {</span>\\n  offsetX?: number;\\n  style?: IStyle.ITextStyle;\\n}\\n</code></pre><h3 id=\\\"autosetaxis-boolean-\\\">autoSetAxis?: boolean;</h3>\\n<ul>\\n<li>Description: Automatically set the text of the axis to avoid repetition and occlusion.</li>\\n</ul>\\n<h3 id=\\\"padding-number-number-\\\">padding?: number | number[];</h3>\\n<ul>\\n<li>Description: Spacing between each view</li>\\n</ul>\\n<h3 id=\\\"transpose-boolean-\\\">transpose?: boolean;</h3>\\n<ul>\\n<li>Description: The transpose property is true, which can flip the mirror facet.</li>\\n</ul>\\n<h3 id=\\\"line-istyle-ilinestyle-\\\">line?: IStyle.ILineStyle;</h3>\\n<ul>\\n<li>Description: Used to configure display properties of lines.</li>\\n</ul>\\n<h3 id=\\\"linesmooth-boolean-\\\">lineSmooth?: boolean;</h3>\\n<ul>\\n<li>Description: Whether the connection line of each tree node is smooth or not , The default is false.</li>\\n</ul>\\n<h3 id=\\\"views-any-\\\">views?: any;</h3>\\n<ul>\\n<li>Description: </li>\\n</ul>\\n<h3 id=\\\"eachview-views-any-facet-any-void-\\\">eachView?: (views: any, facet: any) =&gt; void;</h3>\\n<ul>\\n<li>Description: </li>\\n</ul>\\n<h2 id=\\\"universal-dependency-interface\\\">Universal dependency interface</h2>\\n<h3 id=\\\"text-style\\\">Text style</h3>\\n<pre><code><span class=\\\"hljs-keyword\\\">interface</span> ITextStyle {\\n  fontSize?: <span class=\\\"hljs-built_in\\\">number</span> | <span class=\\\"hljs-built_in\\\">string</span>;\\n  fontFamily?: <span class=\\\"hljs-built_in\\\">string</span>;\\n  fontWeight?: <span class=\\\"hljs-built_in\\\">number</span> | <span class=\\\"hljs-built_in\\\">string</span>;\\n  textAlign?: <span class=\\\"hljs-built_in\\\">string</span>;\\n  fill?: <span class=\\\"hljs-built_in\\\">string</span>;\\n  lineHeight?: <span class=\\\"hljs-built_in\\\">number</span>;\\n  textBaseline?: <span class=\\\"hljs-built_in\\\">string</span>;\\n  rotate?: <span class=\\\"hljs-built_in\\\">number</span>;\\n  shadowBlur?: <span class=\\\"hljs-built_in\\\">number</span>;\\n  shadowColor?: <span class=\\\"hljs-built_in\\\">string</span>;\\n}\\n</code></pre>\";\n\n//# sourceURL=webpack:///./pages/docs/mds/api/viserFacet/en.md?");

