eval("module.exports = \"<h1 id=\\\"legend\\\">Legend</h1>\\n<p>Legend is the auxiliary element of graph. It uses color, size and shape to distinguish different data types for data filtering in graph. Different legend is generated automatically based on the set of graph attribute mapping and data type.</p>\\n<p>shape, color and size, these three graphics attributes automatically generate different legends if they determine that the received parameters are fields of the data source.</p>\\n<p>shape,the legend is generated according to different shape types.\\ncolor,It will give different illustrations and different colors to distinguish graphics.\\nsize,Displays the size of the graph in legend.</p>\\n<h1 id=\\\"api\\\">API</h1>\\n<h3 id=\\\"datakey-string-\\\">dataKey?: string;</h3>\\n<ul>\\n<li>Description: the key of data.</li>\\n</ul>\\n<h3 id=\\\"show-boolean-\\\">show?: boolean;</h3>\\n<ul>\\n<li>Description: show or not.</li>\\n</ul>\\n<h3 id=\\\"position-string-\\\">position?: string;</h3>\\n<ul>\\n<li>Description: Set the display position of the legend. There are 12 values that can be set: left-top,left-center,left-bottom,right-top,right-bottom, right-center,top-left,top-center,top-bottom,bottom-left,bottom-center,bottom-right.You can also use bottom, top, left, right to set the location, then the corresponding values are bottom-center,top-center,left-bottom,right-bottom.</li>\\n</ul>\\n<h3 id=\\\"title-null-object-\\\">title?: null | object;</h3>\\n<ul>\\n<li>Description: Legend title display style settings, if the value is null, that does not display legend title, the default is not displayed.</li>\\n</ul>\\n<h3 id=\\\"custom-boolean-\\\">custom?: boolean;</h3>\\n<ul>\\n<li>Description: The default is false, and when custom is true, it means that the default generated legend is not used, allowing users to customize the legend, including specific legend items and click, hover interaction.Customizing a legend requires the user to declare specific legend items (this property is an array of objects, each of which is an object type, structured as: {value:&#39;&#39;, marker: {fill: &#39;red&#39;}}), and the hover and click events for the legend items.</li>\\n</ul>\\n<h3 id=\\\"offset-number-\\\">offset?: number;</h3>\\n<ul>\\n<li>Description: Legend offset value</li>\\n</ul>\\n<h3 id=\\\"offsetx-number-\\\">offsetX?: number;</h3>\\n<ul>\\n<li>Description: The offset value of the legend x, numeric type, numeric unit &#39;px&#39;, and the default value is 0.</li>\\n</ul>\\n<h3 id=\\\"offsety-number-\\\">offsetY?: number;</h3>\\n<ul>\\n<li>Description: The offset value of the legend y, numeric type, numeric unit &#39;px&#39;, and the default value is 0.</li>\\n</ul>\\n<h3 id=\\\"items-object-\\\">items?: object[];</h3>\\n<ul>\\n<li>Description: Customizing a legend requires the user to declare specific legend items (this property is an array of objects, each of which is an object type, structured as: {value:&#39;&#39;, marker: {fill: &#39;red&#39;}}), and the hover and click events for the legend items.</li>\\n</ul>\\n<h3 id=\\\"itemgap-number-\\\">itemGap?: number;</h3>\\n<ul>\\n<li>Description: For legends of classification types, indicating the spacing between each item of the legend. If the legend is horizontally arranged, it is left and right spacing. If it is vertically arranged, it is upper and lower spacing.</li>\\n</ul>\\n<h3 id=\\\"titlegap-number-\\\">titleGap?: number;</h3>\\n<ul>\\n<li>Description: Discarded</li>\\n</ul>\\n<h3 id=\\\"itemmarginbottom-number-\\\">itemMarginBottom?: number;</h3>\\n<ul>\\n<li>Description: The legend of the classification type takes effect, indicating the distance between the vertical directions of each legend.</li>\\n</ul>\\n<h3 id=\\\"itemsgroup-object-\\\">itemsGroup?: object[];</h3>\\n<ul>\\n<li>Description: Discarded</li>\\n</ul>\\n<h3 id=\\\"layout-string-\\\">layout?: string;</h3>\\n<ul>\\n<li>Description: Effective for legends of classification type, used to set the arrangement of each legend item, can be set values include: vertical, horizontal, indicating vertical and horizontal arrangement.</li>\\n</ul>\\n<h3 id=\\\"allowallcanceled-boolean-\\\">allowAllCanceled?: boolean;</h3>\\n<ul>\\n<li>Description: Effective for legends of classification types, indicates whether all legend items are allowed to be unchecked, defaulting to false, that is, one selected legend item must be retained.</li>\\n</ul>\\n<h3 id=\\\"backpadding-number-\\\">backPadding?: number[];</h3>\\n<ul>\\n<li>Description: Discarded</li>\\n</ul>\\n<h3 id=\\\"itemwidth-number-\\\">itemWidth?: number;</h3>\\n<ul>\\n<li>Description: The legend of the classification type takes effect. Set the width of the legend item, when the legend has many legend items, and the user wants these legend items to be vertical alignment, this property can help users achieve this effect.</li>\\n</ul>\\n<h3 id=\\\"uncheckcolor-string-\\\">unCheckColor?: string;</h3>\\n<ul>\\n<li>Description: The legend of the classification type takes effect. Used to cancel the color of legend text.</li>\\n</ul>\\n<h3 id=\\\"background-object-\\\">background?: object;</h3>\\n<ul>\\n<li>Description: The legend of the classification type takes effect.Used to set the background style used of the legend.</li>\\n</ul>\\n<pre><code>{\\n  <span class=\\\"hljs-attribute\\\">fill</span>: <span class=\\\"hljs-string\\\">'#000'</span>,\\n  fillOpacity: <span class=\\\"hljs-number\\\">0.3</span>\\n}\\n</code></pre><h3 id=\\\"itemformatter-formatterfunc-\\\">itemFormatter?: formatterFunc;</h3>\\n<ul>\\n<li>Description: Callback function which is used to format each text of legend.</li>\\n</ul>\\n<pre><code>itemFormatter(<span class=\\\"hljs-keyword\\\">val</span>) {\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-keyword\\\">val</span>; <span class=\\\"hljs-comment\\\">// Val is the text value for each legend item.</span>\\n}\\n</code></pre><h3 id=\\\"marker-string-func-\\\">marker?: string | func;</h3>\\n<ul>\\n<li>Description: Effective for legends of classification types, used to set the marker style of legends, displayed by default according to the type of geom.</li>\\n</ul>\\n<p>When string type is used, it means that the type supplied by default is supported. The type of support is as follows:</p>\\n<p>todo</p>\\n<p>marker also supports custom shape, which is used as follows.</p>\\n<pre><code>/**\\n * custom the shape of marker \\n * @<span class=\\\"hljs-keyword\\\">param</span>  {number} <span class=\\\"hljs-keyword\\\">x</span>   <span class=\\\"hljs-keyword\\\">The</span> <span class=\\\"hljs-keyword\\\">maker</span>'s x axis coordinate\\n * @<span class=\\\"hljs-keyword\\\">param</span>  {number} <span class=\\\"hljs-keyword\\\">y</span>   <span class=\\\"hljs-keyword\\\">The</span> <span class=\\\"hljs-keyword\\\">maker</span>'s y axis coordinate\\n * @<span class=\\\"hljs-keyword\\\">param</span>  {number} <span class=\\\"hljs-keyword\\\">r</span>   <span class=\\\"hljs-keyword\\\">The</span> <span class=\\\"hljs-keyword\\\">maker</span>'s radius\\n * @<span class=\\\"hljs-keyword\\\">return</span> {null}\\n */\\nmarker(x, y, r) {}\\n</code></pre><p>The following code draws marker as shown in the picture:</p>\\n<pre><code>marker(<span class=\\\"hljs-symbol\\\">x</span>, <span class=\\\"hljs-symbol\\\">y</span>, r) {\\n  <span class=\\\"hljs-keywords\\\">return</span> [\\n    [ <span class=\\\"hljs-string\\\">'M'</span>, <span class=\\\"hljs-symbol\\\">x</span> - r, <span class=\\\"hljs-symbol\\\">y</span> ],\\n    [ <span class=\\\"hljs-string\\\">'L'</span>, <span class=\\\"hljs-symbol\\\">x</span> + r, <span class=\\\"hljs-symbol\\\">y</span> ]\\n  ];\\n}\\n</code></pre><h3 id=\\\"textstyle-istyle-itextstyle-\\\">textStyle?: IStyle.ITextStyle;</h3>\\n<ul>\\n<li>Description: Text style for setting legend items.</li>\\n</ul>\\n<pre><code>textStyle: {\\n  textAlign: <span class=\\\"hljs-string\\\">'center'</span>, // The alignment direction <span class=\\\"hljs-keyword\\\">of</span> the <span class=\\\"hljs-type\\\">text</span> , it can be <span class=\\\"hljs-keyword\\\">set</span> <span class=\\\"hljs-keyword\\\">as</span> follows: <span class=\\\"hljs-keyword\\\">start</span> middle <span class=\\\"hljs-keyword\\\">end</span>\\n  fill: <span class=\\\"hljs-string\\\">'#404040'</span>, // The color <span class=\\\"hljs-keyword\\\">of</span> <span class=\\\"hljs-type\\\">text</span>\\n  fontSize: <span class=\\\"hljs-string\\\">'12'</span>, // The fontSize <span class=\\\"hljs-keyword\\\">of</span> <span class=\\\"hljs-type\\\">text</span>\\n  fontWeight: <span class=\\\"hljs-string\\\">'bold'</span>, // The fontWeight <span class=\\\"hljs-keyword\\\">of</span> <span class=\\\"hljs-type\\\">text</span>\\n  rotate: <span class=\\\"hljs-number\\\">30</span>, // The rotation angle <span class=\\\"hljs-keyword\\\">of</span> the <span class=\\\"hljs-type\\\">text</span> <span class=\\\"hljs-keyword\\\">is</span> taken <span class=\\\"hljs-keyword\\\">as</span> an angle, <span class=\\\"hljs-keyword\\\">only</span> <span class=\\\"hljs-keyword\\\">when</span> autoRotate <span class=\\\"hljs-keyword\\\">is</span> <span class=\\\"hljs-keyword\\\">false</span>.\\n  textBaseline: <span class=\\\"hljs-string\\\">'top'</span> // The <span class=\\\"hljs-type\\\">text</span> baseline which can be <span class=\\\"hljs-keyword\\\">set</span> <span class=\\\"hljs-keyword\\\">as</span> top middle bottom, <span class=\\\"hljs-keyword\\\">and</span> the <span class=\\\"hljs-keyword\\\">default</span> <span class=\\\"hljs-keyword\\\">is</span> middle.\\n}\\n</code></pre><h3 id=\\\"checkable-boolean-\\\">checkable?: boolean;</h3>\\n<ul>\\n<li>Description: Discarded</li>\\n</ul>\\n<h3 id=\\\"clickable-boolean-\\\">clickable?: boolean;</h3>\\n<ul>\\n<li>Description: For the legend of the classification type, set whether the legend item is allowed to click, the default is true, that is, allow to click.</li>\\n</ul>\\n<h3 id=\\\"hoverable-boolean-\\\">hoverable?: boolean;</h3>\\n<ul>\\n<li>Description: For legends of classification type, set whether to turn on the mouse hover to the interactive effect of the legend, the default is true, that is, to turn on animation.</li>\\n</ul>\\n<h3 id=\\\"usehtml-boolean-\\\">useHtml?: boolean;</h3>\\n<ul>\\n<li>Description: For classified type legends, it is used to open whether to use HTML to render legends, default to false, true means to use HTML to render legends.</li>\\n</ul>\\n<h3 id=\\\"autowrap-boolean-\\\">autoWrap?: boolean;</h3>\\n<ul>\\n<li>Description: Discarded</li>\\n</ul>\\n<h3 id=\\\"autoposition-boolean-\\\">autoPosition?: boolean;</h3>\\n<ul>\\n<li>Description: Discarded</li>\\n</ul>\\n<h3 id=\\\"container-any-\\\">container?: any;</h3>\\n<ul>\\n<li>Description: When useHtml is true and is used to specify the DOM container that generates the legend, the incoming index value is supported if the value must be the ID value of the DOM container for the classification type.</li>\\n</ul>\\n<h3 id=\\\"containertpl-string-\\\">containerTpl?: string;</h3>\\n<ul>\\n<li>Description: When useHtml is true, it will be used to specify templates for the legend container. The default values are as follows:</li>\\n</ul>\\n<pre><code>containerTpl: <span class=\\\"hljs-string\\\">'&lt;div class=\\\"</span>g2-legend<span class=\\\"hljs-string\\\">\\\" style=\\\"</span>position:absolute;top:<span class=\\\"hljs-number\\\">20</span>px;right:<span class=\\\"hljs-number\\\">60</span>px;width:auto;<span class=\\\"hljs-string\\\">\\\"&gt;'</span>\\n  + <span class=\\\"hljs-string\\\">'&lt;h4 class=\\\"</span>g2-legend-title<span class=\\\"hljs-string\\\">\\\"&gt;&lt;/h4&gt;'</span>\\n  + <span class=\\\"hljs-string\\\">'&lt;ul class=\\\"</span>g2-legend-<span class=\\\"hljs-built_in\\\">list</span><span class=\\\"hljs-string\\\">\\\" style=\\\"</span><span class=\\\"hljs-built_in\\\">list</span>-style-<span class=\\\"hljs-built_in\\\">type</span>:none;margin:<span class=\\\"hljs-number\\\">0</span>;padding:<span class=\\\"hljs-number\\\">0</span>;<span class=\\\"hljs-string\\\">\\\"&gt;&lt;/ul&gt;'</span>\\n  + <span class=\\\"hljs-string\\\">'&lt;/div&gt;'</span>;\\n</code></pre><h3 id=\\\"itemtpl-string-func-\\\">itemTpl?: string | func;</h3>\\n<ul>\\n<li>Description: Effective when useHtml is true, used to specific the legend item HTML template which is to generate the legend. The default value is as follows:</li>\\n</ul>\\n<pre><code><span class=\\\"xml\\\">itemTpl: '<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">li</span> <span class=\\\"hljs-attr\\\">class</span>=<span class=\\\"hljs-string\\\">\\\"g2-legend-list-item item-</span></span></span><span class=\\\"hljs-template-variable\\\">{index}</span><span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\"><span class=\\\"hljs-string\\\"> </span></span></span><span class=\\\"hljs-template-variable\\\">{checked}</span><span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\"><span class=\\\"hljs-string\\\">\\\"</span> <span class=\\\"hljs-attr\\\">data-color</span>=<span class=\\\"hljs-string\\\">\\\"</span></span></span><span class=\\\"hljs-template-variable\\\">{originColor}</span><span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\"><span class=\\\"hljs-string\\\">\\\"</span> <span class=\\\"hljs-attr\\\">data-value</span>=<span class=\\\"hljs-string\\\">\\\"</span></span></span><span class=\\\"hljs-template-variable\\\">{originValue}</span><span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\"><span class=\\\"hljs-string\\\">\\\"</span> <span class=\\\"hljs-attr\\\">style</span>=<span class=\\\"hljs-string\\\">\\\"cursor: pointer;font-size: 14px;\\\"</span>&gt;</span>'\\n  + '<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">i</span> <span class=\\\"hljs-attr\\\">class</span>=<span class=\\\"hljs-string\\\">\\\"g2-legend-marker\\\"</span> <span class=\\\"hljs-attr\\\">style</span>=<span class=\\\"hljs-string\\\">\\\"width:10px;height:10px;border-radius:50%;display:inline-block;margin-right:10px;background-color: </span></span></span><span class=\\\"hljs-template-variable\\\">{color}</span><span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\"><span class=\\\"hljs-string\\\">;\\\"</span>&gt;</span><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">i</span>&gt;</span>'\\n  + '<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">span</span> <span class=\\\"hljs-attr\\\">class</span>=<span class=\\\"hljs-string\\\">\\\"g2-legend-text\\\"</span>&gt;</span></span><span class=\\\"hljs-template-variable\\\">{value}</span><span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">span</span>&gt;</span>'\\n  + '<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">li</span>&gt;</span>';</span>\\n</code></pre><h3 id=\\\"selectedmode-string-\\\">selectedMode?: string;</h3>\\n<ul>\\n<li>For classified type legends, this configuration entry takes effect when the clickable is true to set the selected interaction mode of the legend, configurable properties:</li>\\n</ul>\\n<blockquote>\\n<p>selectedMode: &#39;single&#39;: means opening the mode of individual election</p>\\n</blockquote>\\n<blockquote>\\n<p>selectedMode: &#39;multiple&#39;: means opening multi select mode, defaults to multiple</p>\\n</blockquote>\\n<h3 id=\\\"reversed-boolean-\\\">reversed?: boolean;</h3>\\n<ul>\\n<li>Description: Discarded</li>\\n</ul>\\n<h3 id=\\\"slidable-boolean-\\\">slidable?: boolean;</h3>\\n<ul>\\n<li>Description: For consecutive legends, it is used to set whether the consecutive legends allow sliding , default to true, that is, to open sliding operation.</li>\\n</ul>\\n<h3 id=\\\"width-number-\\\">width?: number;</h3>\\n<ul>\\n<li>Description: For consecutive legend, it is used to set the width of the legend.</li>\\n</ul>\\n<h3 id=\\\"height-number-\\\">height?: number;</h3>\\n<ul>\\n<li>Description: For consecutive legend, it is used to set the height of the legend.</li>\\n</ul>\\n<h3 id=\\\"legendmarker-any-\\\">legendMarker?: any;</h3>\\n<ul>\\n<li>Description: Discarded</li>\\n</ul>\\n<h3 id=\\\"legendlistitem-any-\\\">legendListItem?: any;</h3>\\n<ul>\\n<li>Description: Discarded</li>\\n</ul>\\n<h3 id=\\\"attachlast-boolean-\\\">attachLast?: boolean;</h3>\\n<ul>\\n<li>Description: Whether tail-legend is enabled or not, the tail-legend automatically follows the last data point of the geom, and the applicable chart types are line, stackLine, area, stackArea. The default is false, which is not enabled.</li>\\n</ul>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/api/viserLegend/en.md?");

