eval("module.exports = \"<h1 id=\\\"series\\\">Series</h1>\\n<p>图形，一般指数据直接生成的图形。</p>\\n<h1 id=\\\"api\\\">API</h1>\\n<h3 id=\\\"quicktype-string-\\\">quickType?: string;</h3>\\n<ul>\\n<li>描述：提供常见的图形。支持如下：</li>\\n</ul>\\n<table>\\n<thead>\\n<tr>\\n<th>type</th>\\n<th>说明</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>line</td>\\n<td>线型图，点按照 x 轴连接成一条线，构成线图</td>\\n</tr>\\n<tr>\\n<td>smoothLine</td>\\n<td>平滑线型图</td>\\n</tr>\\n<tr>\\n<td>dashLine</td>\\n<td>虚线型图</td>\\n</tr>\\n<tr>\\n<td>stackLine</td>\\n<td>堆积线型图</td>\\n</tr>\\n<tr>\\n<td>area</td>\\n<td>面积图, 填充线图跟坐标系之间构成区域图，也可以指定上下范围。</td>\\n</tr>\\n<tr>\\n<td>smoothArea</td>\\n<td>平滑面积</td>\\n</tr>\\n<tr>\\n<td>stackArea</td>\\n<td>堆积面积</td>\\n</tr>\\n<tr>\\n<td>bar</td>\\n<td>柱状图</td>\\n</tr>\\n<tr>\\n<td>stackBar</td>\\n<td>堆叠柱状图</td>\\n</tr>\\n<tr>\\n<td>dodgeBar</td>\\n<td>分组柱状图</td>\\n</tr>\\n<tr>\\n<td>point</td>\\n<td>点，用于点图的构建</td>\\n</tr>\\n<tr>\\n<td>funnel</td>\\n<td>对称漏斗图</td>\\n</tr>\\n<tr>\\n<td>pyramid</td>\\n<td>漏斗图</td>\\n</tr>\\n<tr>\\n<td>schema</td>\\n<td>k 线图，箱型图。</td>\\n</tr>\\n<tr>\\n<td>box</td>\\n<td>箱型图</td>\\n</tr>\\n<tr>\\n<td>candle</td>\\n<td>烛形图</td>\\n</tr>\\n<tr>\\n<td>polygon</td>\\n<td>多边形，可以用于构建热力图、地图等图表类型。，todo</td>\\n</tr>\\n<tr>\\n<td>contour</td>\\n<td>todo</td>\\n</tr>\\n<tr>\\n<td>heatmap</td>\\n<td>热力图</td>\\n</tr>\\n<tr>\\n<td>edge</td>\\n<td>边，适用于树图、流程图、关系图。</td>\\n</tr>\\n<tr>\\n<td>errorBar</td>\\n<td>todo</td>\\n</tr>\\n<tr>\\n<td>jitterPoint</td>\\n<td>扰动点图</td>\\n</tr>\\n<tr>\\n<td>path</td>\\n<td>路径，无序的点连接而成的一条线。</td>\\n</tr>\\n<tr>\\n<td>interval</td>\\n<td>使用矩形或者弧形，用面积来表示大小关系的图形，一般构成柱状图、饼图等图表。</td>\\n</tr>\\n<tr>\\n<td>stackInterval</td>\\n<td>堆叠</td>\\n</tr>\\n<tr>\\n<td>dodgeInterval</td>\\n<td>分组</td>\\n</tr>\\n<tr>\\n<td>sector</td>\\n<td>todo</td>\\n</tr>\\n</tbody>\\n</table>\\n<h3 id=\\\"position-string-string-\\\">position?: string | string[];</h3>\\n<ul>\\n<li>描述：将数据值映射到图形的位置上的方法。</li>\\n</ul>\\n<p>使用 * 连接，position 属性会对多个字段进行数据的映射，如：cutprice，xy 等，用于二维坐标系图表的绘制。</p>\\n<p>以 chart.point().position(&#39;xy&#39;) 为例，point 代表图形，即最后需要生成点图，而 position 代表位置，position(&#39;xy&#39;) 代表数据在图形中的位置由 x 和 y 这两个维度的变量决定，x * y 的数据处理结果可以理解为：\\n[(x1, y1),(x2, y2),(x3, y3),...,(xN, yN),]这样的数值对，最后就会被转换为画布上对应的坐标点。</p>\\n<p>另外，也可以以数组格式传入：</p>\\n<pre><code>&lt;<span class=\\\"hljs-symbol\\\">Series</span> psoition={[ <span class=\\\"hljs-string\\\">'fieldA'</span>, <span class=\\\"hljs-string\\\">'fieldB'</span> ]}/&gt;\\n</code></pre><h3 id=\\\"gemo-string-\\\">gemo?: string;</h3>\\n<ul>\\n<li>描述：可与 adjust 自由组合。 支持 point path line area interval polygon schema edge heatmap pointStack pointJitter pointDodge intervalStack intervalDodge intervalSymmetric areaStack schemaDodge</li>\\n</ul>\\n<p>尽量使用 quickType 自由组合需要理解内部的实现规则</p>\\n<h3 id=\\\"adjust-string-string-object-\\\">adjust?: string | string[] | object[];</h3>\\n<ul>\\n<li>描述：声明几何标记对象的数据调整方式，可用于绘制层叠图、扰动图、分组图等。支持单一的数据调整方式也支持各种数据调整方式的组合。 支持的调整类型包括： &#39;stack&#39;, &#39;dodge&#39;, &#39;jitter&#39;, &#39;symmetric&#39;。</li>\\n</ul>\\n<pre><code>&lt;<span class=\\\"hljs-type\\\">Series</span>\\n  <span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">type</span></span>= <span class=\\\"hljs-string\\\">\\\"point\\\"</span>\\n  adjust= {<span class=\\\"hljs-symbol\\\">'stac</span>k'}\\n  <span class=\\\"hljs-comment\\\">// or</span>\\n  adjust= {[<span class=\\\"hljs-symbol\\\">'dodg</span>e', <span class=\\\"hljs-symbol\\\">'stac</span>k']}\\n  <span class=\\\"hljs-comment\\\">// or</span>\\n  adjust= {[\\n    {\\n      <span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">type</span></span>: <span class=\\\"hljs-symbol\\\">'dodg</span>e',\\n      marginRatio: <span class=\\\"hljs-number\\\">0</span>, <span class=\\\"hljs-comment\\\">// 数值范围为 0 至 1，用于调整分组中各个柱子的间距</span>\\n      dodgeBy: <span class=\\\"hljs-symbol\\\">'x</span>x', <span class=\\\"hljs-comment\\\">// 声明按照 xx 字段进行分组，一般不需要声明</span>\\n    }\\n  ]}\\n/&gt;\\n</code></pre><h3 id=\\\"color-any-\\\">color?: any;</h3>\\n<ul>\\n<li><p>描述：将数据值映射到图形的颜色上的方法。</p>\\n</li>\\n<li><p>常量\\n只支持接收一个参数，value 可以是：</p>\\n</li>\\n<li><p>映射至颜色属性的数据源字段名，如果数据源中不存在这个字段名的话，则按照常量进行解析，这个时候会使用 G2 默认提供的颜色。</p>\\n</li>\\n<li>也可以直接指定某一个具体的颜色值 color，如 &#39;#fff&#39;, &#39;white&#39; 等。</li>\\n</ul>\\n<pre><code>&lt;Series <span class=\\\"hljs-attribute\\\">color</span>=<span class=\\\"hljs-string\\\">'red'</span>/&gt;\\n</code></pre><ul>\\n<li>字段\\n&#39;field&#39;，field 为数据字段名，内部会使用主题中的默认颜色进行数据值到颜色值的映射；</li>\\n</ul>\\n<pre><code>&lt;Series <span class=\\\"hljs-attribute\\\">color</span>=<span class=\\\"hljs-string\\\">'z'</span>/&gt;\\n</code></pre><ul>\\n<li>颜色范围\\n[&#39;field&#39;, colors]，将数据值映射至指定的颜色值 colors（可以是字符串也可以是数组），此时用于通常映射分类数据；</li>\\n</ul>\\n<pre><code>&lt;<span class=\\\"hljs-symbol\\\">Series</span> color={[<span class=\\\"hljs-string\\\">'z'</span>, [ <span class=\\\"hljs-string\\\">'red'</span>, <span class=\\\"hljs-string\\\">'blue'</span> ]]}/&gt;\\n</code></pre><ul>\\n<li>连续颜色渐变\\n[&#39;z&#39;, &#39;l(270) 0:#173162 1:#3663a1&#39;]，指定颜色的渐变路径，用于映射连续的数据；</li>\\n</ul>\\n<pre><code><span class=\\\"hljs-comment\\\">// 使用渐变色</span>\\n&lt;Series color={['z', 'red-blue']}/&gt;\\n\\n<span class=\\\"hljs-comment\\\">// 使用渐变色，l 后面传入角度，0 代表起始颜色，1 代表结束颜色</span>\\n&lt;Series color={['z', 'l(270) 0:#<span class=\\\"hljs-number\\\">173162</span> 1:#<span class=\\\"hljs-number\\\">3663</span>a1']}/&gt;\\n</code></pre><ul>\\n<li>回调函数\\n[&#39;field&#39;, callback)]，使用回调函数进行颜色值的自定义；可以使用多个字段使用*号连接 注意： color 属性的回调函数一般返回的单个颜色，因为 G2 中所有的 shape 仅支持单个颜色 color 属性的回调函数也可以返回数组，数组中有多个颜色，但是这时候需要 shape 支持多颜色的解析，详细情况查看自定义 shape。</li>\\n</ul>\\n<pre><code>&lt;Series\\n  color={[<span class=\\\"hljs-string\\\">'z'</span>, <span class=\\\"hljs-function\\\"><span class=\\\"hljs-params\\\">(value)</span> =&gt;</span> {\\n    <span class=\\\"hljs-keyword\\\">if</span>(value === <span class=\\\"hljs-number\\\">1</span>) {\\n      <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">'red'</span>\\n    }\\n\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">'blue'</span>;\\n  }]}\\n/&gt;\\n</code></pre><h3 id=\\\"shape-any-\\\">shape?: any;</h3>\\n<ul>\\n<li>描述：将数据值映射到图形的形状上的方法。\\n只支持接收一个参数，指定几何图像对象绘制的形状。下表列出了不同的 geom 几何图形对象支持的 shape 形状：</li>\\n</ul>\\n<table>\\n<thead>\\n<tr>\\n<th>geom 类型</th>\\n<th>shape 类型</th>\\n<th>解释</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>point</td>\\n<td>&#39;circle&#39;, &#39;square&#39;, &#39;bowtie&#39;, &#39;diamond&#39;, &#39;hexagon&#39;, &#39;triangle&#39;, &#39;triangle-down&#39;, &#39;hollowCircle&#39;, &#39;hollowSquare&#39;, &#39;hollowBowtie&#39;, &#39;hollowDiamond&#39;,&#39;hollowHexagon&#39;&#39;hollowTriangle&#39;, &#39;hollowTriangle-down&#39;,&#39;cross&#39;, &#39;tick&#39;, &#39;plus&#39;, &#39;hyphen&#39;, &#39;line&#39;</td>\\n<td>hollow 开头的图形都是空心的。</td>\\n</tr>\\n<tr>\\n<td>line</td>\\n<td>&#39;line&#39;,&#39;smooth&#39;,&#39;dot&#39;,&#39;dash&#39;,&#39;spline&#39;</td>\\n<td>--</td>\\n</tr>\\n<tr>\\n<td>area</td>\\n<td>&#39;area&#39;,&#39;smooth&#39;,&#39;line&#39;,&#39;smoothLine&#39;</td>\\n<td>--</td>\\n</tr>\\n<tr>\\n<td>interval</td>\\n<td>&#39;rect&#39;,&#39;hollowRect&#39;,&#39;line&#39;,&#39;tick&#39; hollowRect</td>\\n<td>是空心的矩形，line 和 tick 都是线段</td>\\n</tr>\\n<tr>\\n<td>polygon</td>\\n<td>&#39;polygon&#39;,&#39;hollow&#39;</td>\\n<td>polygon 多边形、hollow 空心多边形。</td>\\n</tr>\\n<tr>\\n<td>schema</td>\\n<td>&#39;box&#39;,&#39;candle&#39;</td>\\n<td>目前仅支持箱型图、K 线图</td>\\n</tr>\\n</tbody>\\n</table>\\n<ul>\\n<li>字段\\ndim 为映射至颜色属性的数据源字段名, 将指定的字段映射到内置的 shapes 数组中；。</li>\\n</ul>\\n<pre><code>&lt;Series <span class=\\\"hljs-attribute\\\">shape</span>=<span class=\\\"hljs-string\\\">'z'</span>/&gt;\\n</code></pre><ul>\\n<li>自定义 shape\\n[&#39;field&#39;, shapes]，用户自己提供 shapes 数据，来进行数据映射；</li>\\n</ul>\\n<pre><code>&lt;Series <span class=\\\"hljs-built_in\\\">shape</span>={[<span class=\\\"hljs-string\\\">'z'</span>, [<span class=\\\"hljs-string\\\">'circle'</span>, <span class=\\\"hljs-string\\\">'rect'</span>]}/&gt;\\n</code></pre><ul>\\n<li>常量\\n将所有数据值映射到固定的 shape。</li>\\n</ul>\\n<pre><code>&lt;Series <span class=\\\"hljs-attribute\\\">shape</span>=<span class=\\\"hljs-string\\\">'point'</span>/&gt;\\n</code></pre><p>提供以下默认形状：</p>\\n<pre><code><span class=\\\"hljs-keyword\\\">const</span> shapes = {\\n  <span class=\\\"hljs-built_in\\\">point</span>: [ <span class=\\\"hljs-string\\\">'hollowCircle'</span>, <span class=\\\"hljs-string\\\">'hollowSquare'</span>, <span class=\\\"hljs-string\\\">'hollowDiamond'</span>, <span class=\\\"hljs-string\\\">'hollowBowtie'</span>, <span class=\\\"hljs-string\\\">'hollowTriangle'</span>, <span class=\\\"hljs-string\\\">'hollowHexagon'</span>, <span class=\\\"hljs-string\\\">'cross'</span>, <span class=\\\"hljs-string\\\">'tick'</span>, <span class=\\\"hljs-string\\\">'plus'</span>, <span class=\\\"hljs-string\\\">'hyphen'</span>, <span class=\\\"hljs-string\\\">'line'</span> ],\\n  <span class=\\\"hljs-built_in\\\">line</span>: [ <span class=\\\"hljs-string\\\">'line'</span>, <span class=\\\"hljs-string\\\">'dash'</span>, <span class=\\\"hljs-string\\\">'dot'</span> ],\\n  area: [ <span class=\\\"hljs-string\\\">'area'</span> ]\\n};\\n</code></pre><h3 id=\\\"size-any-\\\">size?: any;</h3>\\n<ul>\\n<li>描述：将数据值映射到图形的大小上的方法。</li>\\n</ul>\\n<blockquote>\\n<p>对于不同的几何标记含义不完全一致：</p>\\n<ol>\\n<li>对于 point 点来说，size 对应着点的半径；</li>\\n<li>对于 line 线来说，size 对应着线的粗细；</li>\\n<li>对于 interval 柱状图来说，size 对应着柱子的宽度。</li>\\n</ol>\\n</blockquote>\\n<ul>\\n<li>常量\\n指定像素大小。</li>\\n</ul>\\n<pre><code><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Series</span> <span class=\\\"hljs-attr\\\">size</span>=<span class=\\\"hljs-string\\\">{3}/</span>&gt;</span>\\n</code></pre><ul>\\n<li>字段\\n指定映射到 size 的字段，使用内置的默认大小范围为 [1, 10]；</li>\\n</ul>\\n<pre><code>&lt;Series <span class=\\\"hljs-built_in\\\">size</span>={<span class=\\\"hljs-string\\\">'z'</span>}/&gt;\\n</code></pre><ul>\\n<li>设置范围\\n指定映射到 size 字段外，还提供了 size 的最大值和最小值范围；</li>\\n</ul>\\n<pre><code>&lt;<span class=\\\"hljs-symbol\\\">Series</span> size={[<span class=\\\"hljs-string\\\">'z'</span>, [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">10</span>]]}/&gt;\\n</code></pre><h3 id=\\\"opacity-any-\\\">opacity?: any;</h3>\\n<ul>\\n<li>描述：将数据值映射到图形的透明度上的方法。</li>\\n</ul>\\n<pre><code>&lt;Series opacity=<span class=\\\"hljs-string\\\">'field'</span>/&gt; <span class=\\\"hljs-comment\\\">// 使用字段映射到透明度</span>\\n\\n&lt;Series opacity={<span class=\\\"hljs-number\\\">0.2</span>}/&gt; <span class=\\\"hljs-comment\\\">// 常量，但是数值范围为 0 - 1</span>\\n\\n&lt;Series opacity={[<span class=\\\"hljs-string\\\">'z'</span>, (z)=&gt;{ <span class=\\\"hljs-comment\\\">// 回调函数</span>\\n  <span class=\\\"hljs-keyword\\\">if</span>(z &gt; <span class=\\\"hljs-number\\\">1000</span>)\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-number\\\">0.6</span>;\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-number\\\">0.1</span>;\\n}]}/&gt;\\n</code></pre><h3 id=\\\"label-any-\\\">label?: any;</h3>\\n<ul>\\n<li><p>描述：将数据值映射到图形的文本上的方法。</p>\\n</li>\\n<li><p>字段</p>\\n</li>\\n</ul>\\n<pre><code>&lt;Series <span class=\\\"hljs-keyword\\\">label</span>=<span class=\\\"hljs-string\\\">'field'</span>/&gt;  <span class=\\\"hljs-comment\\\">// 使用字段映射到文本</span>\\n</code></pre><ul>\\n<li>字段配置\\n设置显示文本的配置信息。field 代表数据源中的数据字段名。</li>\\n</ul>\\n<pre><code>&lt;Series label={[<span class=\\\"hljs-string\\\">'x'</span>, {\\n  offset: <span class=\\\"hljs-number\\\">10</span>\\n  textStyle: {\\n    fill: <span class=\\\"hljs-string\\\">'red'</span>\\n  }\\n}]}/&gt;\\n</code></pre><ul>\\n<li>回调函数\\n使用回调函数控制文本显示。</li>\\n</ul>\\n<pre><code>&lt;Series label={[<span class=\\\"hljs-string\\\">'x*y*z'</span>, <span class=\\\"hljs-function\\\"><span class=\\\"hljs-params\\\">(x, y, z)</span> =&gt;</span> {\\n  <span class=\\\"hljs-keyword\\\">return</span>; <span class=\\\"hljs-regexp\\\">//</span> something\\n}]}/&gt;\\n</code></pre><h3 id=\\\"tooltip-any-\\\">tooltip?: any;</h3>\\n<ul>\\n<li>描述：将数据值映射到 Tooltip 上。</li>\\n</ul>\\n<pre><code>&lt;Series <span class=\\\"hljs-built_in\\\">tooltip</span>={<span class=\\\"hljs-literal\\\">false</span>} /&gt;\\n\\n&lt;Series\\n  <span class=\\\"hljs-built_in\\\">tooltip</span>={[<span class=\\\"hljs-string\\\">'dim1*dim2'</span>, (dim1, dim2)=&gt;{\\n    <span class=\\\"hljs-keyword\\\">return</span> {\\n      name:<span class=\\\"hljs-string\\\">'xxx'</span>,\\n      value:dim1 + <span class=\\\"hljs-string\\\">':'</span> + dim2\\n    }\\n  }]}\\n/&gt;\\n\\n&lt;Series <span class=\\\"hljs-built_in\\\">tooltip</span>={<span class=\\\"hljs-string\\\">'dim1*dim2...*dimN'</span>} /&gt;\\n</code></pre><h3 id=\\\"style-any-\\\">style?: any;</h3>\\n<ul>\\n<li>描述：配置几何图形的样式。 当 style 的值是 Object 时，该 Object 中只能设置固定样式。 当 style 的值是 Array 时，可以通过回调函数根据具体的数据去动态配置样式。</li>\\n</ul>\\n<pre><code>&lt;Series\\n  style={{\\n    <span class=\\\"hljs-attr\\\">lineWidth</span>:<span class=\\\"hljs-number\\\">1</span>\\n  }}\\n  <span class=\\\"hljs-comment\\\">//或者</span>\\n  style={[<span class=\\\"hljs-string\\\">'x*y'</span>, {\\n    <span class=\\\"hljs-attr\\\">lineWidth</span>:<span class=\\\"hljs-number\\\">1</span>,\\n    <span class=\\\"hljs-attr\\\">stroke</span>:<span class=\\\"hljs-function\\\">(<span class=\\\"hljs-params\\\">sales, city</span>)=&gt;</span>{\\n      <span class=\\\"hljs-keyword\\\">if</span>(city === <span class=\\\"hljs-string\\\">'hangzhou'</span> &amp;&amp; sales &gt; <span class=\\\"hljs-number\\\">1000</span>)\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"#ff0000\\\"</span>;\\n      <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"#00ff00\\\"</span>;\\n    }\\n   }]}\\n/&gt;\\n</code></pre><h3 id=\\\"select-any-\\\">select?: any;</h3>\\n<ul>\\n<li>描述：开启、关闭以及设置 shape 对于鼠标 click 事件的响应效果， 默认仅为饼图开启了选中效果。</li>\\n</ul>\\n<pre><code>&lt;Series <span class=\\\"hljs-keyword\\\">select</span>={<span class=\\\"hljs-literal\\\">false</span>} /&gt;\\n</code></pre><h3 id=\\\"active-boolean-\\\">active?: boolean;</h3>\\n<ul>\\n<li>描述：开启以及关闭 shape 对于鼠标 hover 时的响应效果， 默认为各个 shape 内置了 active 效果 。</li>\\n</ul>\\n<pre><code><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Series</span> <span class=\\\"hljs-attr\\\">active</span>=<span class=\\\"hljs-string\\\">{false}</span> /&gt;</span>\\n</code></pre><h3 id=\\\"animate-object-\\\">animate?: object;</h3>\\n<ul>\\n<li>描述：动画配置。</li>\\n</ul>\\n<pre><code>const animate = {\\n<span class=\\\"hljs-symbol\\\">  appear:</span> {\\n    <span class=\\\"hljs-comment\\\">// 初始入场动画配置</span>\\n  }\\n<span class=\\\"hljs-symbol\\\">  enter:</span> {\\n    <span class=\\\"hljs-comment\\\">// 更新时出现动画配置</span>\\n  },\\n<span class=\\\"hljs-symbol\\\">  leave:</span> {\\n    <span class=\\\"hljs-comment\\\">// 更新时销毁动画配置</span>\\n  },\\n<span class=\\\"hljs-symbol\\\">  update:</span> {\\n    <span class=\\\"hljs-comment\\\">// 更新时改变动画配置</span>\\n  }\\n};\\n<span class=\\\"hljs-params\\\">&lt;Series animate={animate} /&gt;</span>\\n</code></pre><h3 id=\\\"onmousedown-eventfunc-\\\">onMouseDown?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"onmousemove-eventfunc-\\\">onMouseMove?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"onmouseleave-eventfunc-\\\">onMouseLeave?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"onmouseup-eventfunc-\\\">onMouseUp?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"onclick-eventfunc-\\\">onClick?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"ondbclick-eventfunc-\\\">onDbClick?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"ontouchstart-eventfunc-\\\">onTouchStart?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"ontouchmove-eventfunc-\\\">onTouchMove?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"ontouchend-eventfunc-\\\">onTouchEnd?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"onlabelmousedown-eventfunc-\\\">onLabelMouseDown?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"onlabelmousemove-eventfunc-\\\">onLabelMouseMove?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"onlabelmouseleave-eventfunc-\\\">onLabelMouseLeave?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"onlabelmouseup-eventfunc-\\\">onLabelMouseUp?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"onlabelclick-eventfunc-\\\">onLabelClick?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"onlabeldbclick-eventfunc-\\\">onLabelDbClick?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"onlabletouchstart-eventfunc-\\\">onLableTouchStart?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"onlabeltouchmove-eventfunc-\\\">onLabelTouchMove?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n<h3 id=\\\"onlabeltouchend-eventfunc-\\\">onLabelTouchEnd?: eventFunc;</h3>\\n<ul>\\n<li>描述：见 event</li>\\n</ul>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/api/viserSeries/cn.md?");

