eval("module.exports = \"<h1 id=\\\"slider\\\">Slider</h1>\\n<p>用于数据范围的选择插件，尤其适用于大数据量的图表绘制，帮助用户更好地关注某一范围的数据可视化结果。</p>\\n<h2 id=\\\"api\\\">API</h2>\\n<h3 id=\\\"xaxis-string-\\\">xAxis: string;</h3>\\n<ul>\\n<li>描述：必须声明，我们的 Slider 是带有背景图表的滑动条组件，该字段用于声明该背景图表的横轴映射字段，同时该字段也是数据过滤字段。</li>\\n</ul>\\n<h3 id=\\\"yaxis-string-\\\">yAxis: string;</h3>\\n<ul>\\n<li>描述：必须声明，我们的 Slider 是带有背景图表的滑动条组件，该字段用于声明该背景图表的纵轴轴映射字段。</li>\\n</ul>\\n<h3 id=\\\"data-any-\\\">data: any[];</h3>\\n<ul>\\n<li>描述：必须声明，数据源。</li>\\n</ul>\\n<h3 id=\\\"container-any-\\\">container?: any;</h3>\\n<ul>\\n<li>描述：对应 slider 的 DOM 容器，可以传入该 DOM 的 id 或者直接传入容器的 html 节点对象。</li>\\n</ul>\\n<h3 id=\\\"width-number-string-\\\">width?: number | string;</h3>\\n<ul>\\n<li>描述：设置 slider 组件的宽度，默认为 auto，表示自适应容器的宽度。</li>\\n</ul>\\n<h3 id=\\\"height-number-string-\\\">height?: number | string;</h3>\\n<ul>\\n<li>描述：设置 slider 组件的高度，默认为 26，单位为 &#39;px&#39;。</li>\\n</ul>\\n<h3 id=\\\"padding-number-number-\\\">padding?: number | number[];</h3>\\n<ul>\\n<li>描述：设置 slider 组件所在画布 canvas 的内边距，用于与图表对齐（默认图表的 canvas 容器也是带了内边距），默认值同 G2 默认主题的 padding 相同，[ 20, 20, 95, 80 ]。</li>\\n</ul>\\n<h3 id=\\\"start-string-\\\">start?: string;</h3>\\n<ul>\\n<li>描述：声明滑动条起始滑块的位置对应的数据值，默认为最小值。</li>\\n</ul>\\n<h3 id=\\\"end-string-\\\">end?: string;</h3>\\n<ul>\\n<li>描述：声明滑动条结束滑块的位置对应的数据值，默认为最大值。</li>\\n</ul>\\n<h3 id=\\\"minspan-number-\\\">minSpan?: number;</h3>\\n<ul>\\n<li>描述：</li>\\n</ul>\\n<h3 id=\\\"maxspan-number-\\\">maxSpan?: number;</h3>\\n<ul>\\n<li>描述：</li>\\n</ul>\\n<h3 id=\\\"scales-any-\\\">scales?: any;</h3>\\n<ul>\\n<li>描述：用于对 xAxis 和 yAxis 字段进行列定义，用于同操作的图表中对应的列定义相同。</li>\\n</ul>\\n<p>示例代码：</p>\\n<pre><code>{\\n  <span class=\\\"hljs-selector-attr\\\">[`${xAxis}`]</span>: {\\n    <span class=\\\"hljs-attribute\\\">type</span>: <span class=\\\"hljs-string\\\">'time'</span>,\\n    <span class=\\\"hljs-attribute\\\">mask</span>: <span class=\\\"hljs-string\\\">'MM-DD'</span>\\n  }\\n}\\n</code></pre><h3 id=\\\"backgroundchart-any-\\\">backgroundChart?: any;</h3>\\n<ul>\\n<li>描述：slider 滑块的背景图表配置，可配置其图表类型以及颜色：</li>\\n</ul>\\n<pre><code>{\\n  <span class=\\\"hljs-attribute\\\">type</span>: [ <span class=\\\"hljs-string\\\">'area'</span> ], // 图表的类型，可以是字符串也可是是数组\\n  color: <span class=\\\"hljs-string\\\">'#CCD6EC'</span>\\n}\\n</code></pre><h3 id=\\\"onchange-opts-any-\\\">onChange?: (opts: any) =&gt; {};</h3>\\n<ul>\\n<li>描述：当滑动条滑块发生变化时，触发该回调函数，主要用于更新 ds 的状态量。该回调函数会提供一个参数，该参数是一个对象，包含如下属性：</li>\\n</ul>\\n<pre><code>onChange: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-params\\\">(obj)</span> =&gt;</span> {\\n  const { startValue, endValue, startText, endText } = obj;\\n}\\n</code></pre><ul>\\n<li>startValue 起点滑块当前对应的原始数据值，如果是 time 或者 timeCat 类型时，该值为时间戳，请注意。</li>\\n<li>endValue 终点滑块当前对应的原始数据值，如果是 time 或者 timeCat 类型时，该值为时间戳，请注意。</li>\\n<li>startText 起点滑块当前的显示文本值</li>\\n<li>endText 终点滑块当前的显示文本值</li>\\n</ul>\\n<blockquote>\\n<p>说明：之所以区分 text 和 value，是因为大部分情况下用户会对数值进行格式化，所以在设置状态量和更新状态量时，需要保证前后数值类型的一致。</p>\\n</blockquote>\\n<h3 id=\\\"handlestyle-any\\\">handleStyle?: any</h3>\\n<p>todo</p>\\n<ul>\\n<li>描述：slider 滑块的样式配置，可配置的属性如下：</li>\\n</ul>\\n<pre><code>{\\n  <span class=\\\"hljs-selector-tag\\\">img</span>: <span class=\\\"hljs-string\\\">'https://gw.alipayobjects.com/zos/rmsportal/QXtfhORGlDuRvLXFzpsQ.png'</span>, <span class=\\\"hljs-comment\\\">// 可以是图片地址也可以是 data urls</span>\\n  <span class=\\\"hljs-attribute\\\">width</span>: <span class=\\\"hljs-number\\\">5</span>,\\n  <span class=\\\"hljs-attribute\\\">height</span>: <span class=\\\"hljs-number\\\">26</span>\\n}\\n</code></pre><h3 id=\\\"textstyle-any\\\">textStyle?: any</h3>\\n<p>todo</p>\\n<ul>\\n<li>描述：slider 辅助文本字体样式配置。</li>\\n</ul>\\n<h3 id=\\\"backgroundstyle-any\\\">backgroundStyle?: any</h3>\\n<p>todo</p>\\n<ul>\\n<li>描述：slider 整体背景样式。</li>\\n</ul>\\n<h3 id=\\\"fillerstyle-any\\\">fillerStyle?: any</h3>\\n<p>todo</p>\\n<ul>\\n<li>描述：选中区域的样式配置，默认配置如下：</li>\\n</ul>\\n<pre><code>{\\n  <span class=\\\"hljs-attribute\\\">fill</span>: <span class=\\\"hljs-string\\\">'#BDCCED'</span>,\\n  fillOpacity: <span class=\\\"hljs-number\\\">0.3</span>\\n}\\n</code></pre>\";\n\n//# sourceURL=webpack:///./pages/docs/mds/api/viserSlider/cn.md?");

