eval("module.exports = \"<h1 id=\\\"tooltip\\\">Tooltip</h1>\\n<p>The tooltip component is a tooltip box that displays the data of a point when the mouse hovers over it, such as the value of the point, the unit of data, etc.</p>\\n<h2 id=\\\"api\\\">API</h2>\\n<h3 id=\\\"x-number-\\\">x?: number;</h3>\\n<ul>\\n<li>Description:</li>\\n</ul>\\n<h3 id=\\\"y-number-\\\">y?: number;</h3>\\n<ul>\\n<li>Description:</li>\\n</ul>\\n<h3 id=\\\"items-object-\\\">items?: object[];</h3>\\n<ul>\\n<li>Description:</li>\\n</ul>\\n<h3 id=\\\"show-boolean-\\\">show?: boolean;</h3>\\n<ul>\\n<li>Description: whether show the tooltip or not.</li>\\n</ul>\\n<h3 id=\\\"triggeron-triggertype-\\\">triggerOn?: triggerType;</h3>\\n<ul>\\n<li><p>Description: Tooltip can be triggered with these configurable values: &#39;mousemove&#39;,&#39;click&#39;,&#39;none&#39;, defaulting to mousemove.</p>\\n</li>\\n<li><p>&#39;mousemove&#39;: trigger with mouse move.</p>\\n</li>\\n<li>&#39;click&#39;: trigger with mouse click.</li>\\n<li>&#39;none&#39;: Don&#39;t trigger tooltip, The user controls tooltip&#39;s display and hiding through &#39;chart.showTooltip()&#39; and &#39;chart.hideTooltip()&#39;.</li>\\n</ul>\\n<h3 id=\\\"showtitle-boolean-\\\">showTitle?: boolean;</h3>\\n<ul>\\n<li>Description: Whether to display the title of the tooltip, default to true, that is, display, by setting it to false to hide the title.</li>\\n</ul>\\n<h3 id=\\\"title-string-\\\">title?: string;</h3>\\n<ul>\\n<li>Description: Set the data field displayed by the title of the tooltip, and when this field is set, the title displays the corresponding value of the field. When showTitle is false, the settings do not work.</li>\\n</ul>\\n<h3 id=\\\"crosshairs-boolean-icrosshairs-\\\">crosshairs?: boolean | ICrosshairs;</h3>\\n<ul>\\n<li>Description: It is an object type that is used to set up the auxiliary line or auxiliary box of tooltip.</li>\\n</ul>\\n<p>By default, we open vertical auxiliary lines for geom as &#39;line&#39;,&#39;area&#39;,&#39;path&#39;,&#39;areaStack&#39;; and geom displays a rectangular background box for &#39;interval&#39; by default.</p>\\n<p>The supporting configuration is as follows:</p>\\n<pre><code>interface ICrosshairs {\\n  <span class=\\\"hljs-keyword\\\">type</span>?: string;  // <span class=\\\"hljs-string\\\">'rect'</span> represents a rectangle, <span class=\\\"hljs-string\\\">'X'</span> represents a horizontal auxiliary <span class=\\\"hljs-type\\\">line</span>, <span class=\\\"hljs-string\\\">'Y '</span>represents a vertical auxiliary <span class=\\\"hljs-type\\\">line</span>, <span class=\\\"hljs-keyword\\\">and</span> <span class=\\\"hljs-string\\\">'cross'</span> represents a <span class=\\\"hljs-keyword\\\">cross</span> auxiliary <span class=\\\"hljs-type\\\">line</span>.\\n  style?: IStyle.ILineStyle;\\n}\\n</code></pre><h3 id=\\\"offset-number-\\\">offset?: number;</h3>\\n<ul>\\n<li>Description: Set the tooltip offset from the mouse.</li>\\n</ul>\\n<h3 id=\\\"inplot-boolean-\\\">inPlot?: boolean;</h3>\\n<ul>\\n<li>Description: Set whether to restrict tooltip to the drawing area, defaults to true, that is, it is restricted to the drawing area.</li>\\n</ul>\\n<h3 id=\\\"follow-boolean-\\\">follow?: boolean;</h3>\\n<ul>\\n<li>Description: Set whether tooltip to follow the mouse movement. The default is true, that is, follow.</li>\\n</ul>\\n<h3 id=\\\"shared-boolean-\\\">shared?: boolean;</h3>\\n<ul>\\n<li>Description: Whether to display multiple tooltip, default value is true, false indicates only one tooltip.</li>\\n</ul>\\n<h3 id=\\\"enterable-boolean-\\\">enterable?: boolean;</h3>\\n<ul>\\n<li>Description: To control whether the mouse is allowed to enter tooltip, the default is false, which is not allowed to enter.</li>\\n</ul>\\n<h3 id=\\\"position-string-\\\">position?: string;</h3>\\n<ul>\\n<li>Description: After this property is set, tooltip is displayed in a fixed location with the settable values: left, right, top, bottom.</li>\\n</ul>\\n<h3 id=\\\"hidemarkers-boolean-\\\">hideMarkers?: boolean;</h3>\\n<ul>\\n<li>Description: For line, area, and path geometries, tooltipMarker is automatically rendered when tooltip is rendered, and the tooltipMarker is closed by declaring the property value true.</li>\\n</ul>\\n<h3 id=\\\"containertpl-string-\\\">containerTpl?: string;</h3>\\n<ul>\\n<li>Description: Tooltip default container template with default values as follows:</li>\\n</ul>\\n<pre><code>containerTpl= '&lt;<span class=\\\"hljs-keyword\\\">div</span> <span class=\\\"hljs-built_in\\\">class</span>=<span class=\\\"hljs-string\\\">\\\"g2-tooltip\\\"</span>&gt;'\\n  + '&lt;<span class=\\\"hljs-keyword\\\">div</span> <span class=\\\"hljs-built_in\\\">class</span>=<span class=\\\"hljs-string\\\">\\\"g2-tooltip-title\\\"</span> style=<span class=\\\"hljs-string\\\">\\\"margin-bottom: 4px;\\\"</span>&gt;&lt;/<span class=\\\"hljs-keyword\\\">div</span>&gt;'\\n  + '&lt;ul <span class=\\\"hljs-built_in\\\">class</span>=<span class=\\\"hljs-string\\\">\\\"g2-tooltip-list\\\"</span>&gt;&lt;/ul&gt;'\\n  + '&lt;/<span class=\\\"hljs-keyword\\\">div</span>&gt;',\\n</code></pre><p>If the default structure does not meet the requirements, you can customize the template, but when you customize the template, you must include the class of each DOM node, and the style can be customized.</p>\\n<h3 id=\\\"itemtpl-string-\\\">itemTpl?: string;</h3>\\n<ul>\\n<li>Description: The default template for each item is tooltip. The default values are as follows:</li>\\n</ul>\\n<pre><code><span class=\\\"xml\\\">itemTpl: '<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">li</span> <span class=\\\"hljs-attr\\\">data-index</span>=</span></span><span class=\\\"hljs-template-variable\\\">{index}</span><span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\">&gt;</span>'\\n  + '<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">span</span> <span class=\\\"hljs-attr\\\">style</span>=<span class=\\\"hljs-string\\\">\\\"background-color:</span></span></span><span class=\\\"hljs-template-variable\\\">{color}</span><span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\"><span class=\\\"hljs-string\\\">;width:8px;height:8px;border-radius:50%;display:inline-block;margin-right:8px;\\\"</span>&gt;</span><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">span</span>&gt;</span>'\\n  + '</span><span class=\\\"hljs-template-variable\\\">{name}</span><span class=\\\"xml\\\">: </span><span class=\\\"hljs-template-variable\\\">{value}</span><span class=\\\"xml\\\">'\\n  + '<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">li</span>&gt;</span>'</span>\\n</code></pre><p>If the default structure does not meet the requirements, you can customize the template, but when you customize the template, you must include the class of each DOM node, and the style can be customized.</p>\\n<h3 id=\\\"g2tooltip-any-\\\">g2Tooltip?: any;</h3>\\n<ul>\\n<li>Description: Set the CSS style of the tooltip container.</li>\\n</ul>\\n<h3 id=\\\"g2tooltiptitle-any-\\\">g2TooltipTitle?: any;</h3>\\n<ul>\\n<li>Description: Sets the CSS style of the tooltip title.</li>\\n</ul>\\n<h3 id=\\\"g2tooltiplist-any-\\\">g2TooltipList?: any;</h3>\\n<ul>\\n<li>Description: Set the CSS style of the tooltip list container.</li>\\n</ul>\\n<h3 id=\\\"g2tooltiplistitem-any-\\\">g2TooltipListItem?: any;</h3>\\n<ul>\\n<li>Description: Set the CSS style of each item in the tooltip list container.</li>\\n</ul>\\n<h3 id=\\\"g2tooltipmarker-any-\\\">g2TooltipMarker?: any;</h3>\\n<ul>\\n<li>Description: Set the CSS style of each marker in the tooltip list container.</li>\\n</ul>\\n<h3 id=\\\"onshow-eventfunc-\\\">onShow?: eventFunc;</h3>\\n<ul>\\n<li>Description:</li>\\n</ul>\\n<h3 id=\\\"onhide-eventfunc-\\\">onHide?: eventFunc;</h3>\\n<ul>\\n<li>Description:</li>\\n</ul>\\n<h3 id=\\\"onchange-eventfunc-\\\">onChange?: eventFunc;</h3>\\n<ul>\\n<li>Description:</li>\\n</ul>\\n<h3 id=\\\"defaultpoint-any-\\\">defaultPoint?: any;</h3>\\n<ul>\\n<li>Description:</li>\\n</ul>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/api/viserTooltip/en.md?");

