eval("module.exports = \"<h1 id=\\\"view\\\">View</h1>\\n<p>视图，由 Chart 生成和管理，拥有自己独立的数据源、坐标系和图层，用于异构数据的可视化以及图表组合，一个 Chart 由一个或者多个视图 View 组成。因此 view 上的 api 同 chart 基本相同。</p>\\n<h1 id=\\\"api\\\">API</h1>\\n<h3 id=\\\"data-any-\\\">data?: any;</h3>\\n<ul>\\n<li>描述：视图的数据源，同时也可以使用 view.source(data) 方法设置数据源。</li>\\n</ul>\\n<h3 id=\\\"viewid-string-\\\">viewId?: string;</h3>\\n<ul>\\n<li>描述：视图 id，唯一标识视图</li>\\n</ul>\\n<h3 id=\\\"dataview-any-\\\">dataView?: any;</h3>\\n<ul>\\n<li>描述：deprecate</li>\\n</ul>\\n<h3 id=\\\"coord-icoord-\\\">coord?: ICoord;</h3>\\n<ul>\\n<li>描述：使用同 Chart 的 coord 属性。</li>\\n</ul>\\n<h3 id=\\\"scale-iscale-\\\">scale?: IScale;</h3>\\n<ul>\\n<li>描述：使用同 Chart 的 scale 属性。</li>\\n</ul>\\n<h3 id=\\\"axis-iaxis-\\\">axis?: IAxis;</h3>\\n<ul>\\n<li>描述：使用同 Chart 的 axis 属性。</li>\\n</ul>\\n<h3 id=\\\"guide-iguide-\\\">guide?: IGuide;</h3>\\n<ul>\\n<li>描述：使用同 Chart 的 guide 属性。</li>\\n</ul>\\n<h3 id=\\\"series-iseries-\\\">series?: ISeries;</h3>\\n<ul>\\n<li>描述：使用同 Chart 的 series 属性。</li>\\n</ul>\\n<h3 id=\\\"tooltip-itooltip-\\\">tooltip?: ITooltip;</h3>\\n<ul>\\n<li>描述：使用同 Chart 的 tooltip 属性。</li>\\n</ul>\\n<h3 id=\\\"start-any-\\\">start?: any;</h3>\\n<ul>\\n<li>描述：绘制区域的起始坐标，结构如下：</li>\\n</ul>\\n<pre><code>{\\n  x: <span class=\\\"hljs-number\\\">0</span>, <span class=\\\"hljs-comment\\\">// x 取值范围为 0 - 1</span>\\n  y: <span class=\\\"hljs-number\\\">0</span> <span class=\\\"hljs-comment\\\">// y 取值范围为 0 - 1</span>\\n}\\n</code></pre><p>对于 view，我们的起始点是从左上角开始的。</p>\\n<h3 id=\\\"end-any-\\\">end?: any;</h3>\\n<ul>\\n<li>描述：绘制区域的终点坐标，结构如下：</li>\\n</ul>\\n<pre><code>{\\n  x: <span class=\\\"hljs-number\\\">0</span>, <span class=\\\"hljs-comment\\\">// x 取值范围为 0 -1</span>\\n  y: <span class=\\\"hljs-number\\\">0</span> <span class=\\\"hljs-comment\\\">// y 取值范围为 0 -1</span>\\n}\\n</code></pre><h3 id=\\\"animate-boolean\\\">animate?: boolean</h3>\\n<p>todo</p>\\n<ul>\\n<li>描述：视图是否执行动画，默认执行。<blockquote>\\n<p>注意：chart 下创建的 view 将默认使用 chart 的 列定义、坐标轴 axis 配置、坐标系 coord 配置，即如果 view 不自己定义则默认同 chart 的配置相同；如果 view 自己定义了相应的配置，则以自己的为准。</p>\\n</blockquote>\\n</li>\\n</ul>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/api/viserView/cn.md?");

