eval("module.exports = \"<h1 id=\\\"view\\\">View</h1>\\n<p>View, generated and managed by Chart, has its own independent data sources, coordinate systems and layers for heterogeneous data visualization and chart composition. A Chart consists of one or more Views. So the API on View is basically the same as Chart.</p>\\n<h1 id=\\\"api\\\">API</h1>\\n<h3 id=\\\"data-any-\\\">data?: any;</h3>\\n<ul>\\n<li>Description: The data source of the view can also be set up using the method: view.source(data).</li>\\n</ul>\\n<h3 id=\\\"viewid-string-\\\">viewId?: string;</h3>\\n<ul>\\n<li>Description: View ID, the unique identification of View</li>\\n</ul>\\n<h3 id=\\\"dataview-any-\\\">dataView?: any;</h3>\\n<ul>\\n<li>Description: deprecate</li>\\n</ul>\\n<h3 id=\\\"coord-icoord-\\\">coord?: ICoord;</h3>\\n<ul>\\n<li>Description: Use the coord property the same as Chart.</li>\\n</ul>\\n<h3 id=\\\"scale-iscale-\\\">scale?: IScale;</h3>\\n<ul>\\n<li>Description: Use the scale property the same as Chart.</li>\\n</ul>\\n<h3 id=\\\"axis-iaxis-\\\">axis?: IAxis;</h3>\\n<ul>\\n<li>Description: Use the axis property the same as Chart.</li>\\n</ul>\\n<h3 id=\\\"guide-iguide-\\\">guide?: IGuide;</h3>\\n<ul>\\n<li>Description: Use the guide property the same as Chart.</li>\\n</ul>\\n<h3 id=\\\"series-iseries-\\\">series?: ISeries;</h3>\\n<ul>\\n<li>Description: Use the series property the same as Chart.</li>\\n</ul>\\n<h3 id=\\\"tooltip-itooltip-\\\">tooltip?: ITooltip;</h3>\\n<ul>\\n<li>Description: Use the tooltip property the same as Chart.</li>\\n</ul>\\n<h3 id=\\\"start-any-\\\">start?: any;</h3>\\n<ul>\\n<li>Description: Draw the initial coordinates of the region. The structure is as follows:</li>\\n</ul>\\n<pre><code>{\\n  x: <span class=\\\"hljs-number\\\">0</span>, <span class=\\\"hljs-comment\\\">// X has a range of 0-1.</span>\\n  y: <span class=\\\"hljs-number\\\">0</span> <span class=\\\"hljs-comment\\\">// Y has a range of 0-1.</span>\\n}\\n</code></pre><p>For view, our starting point is from the upper left corner.</p>\\n<h3 id=\\\"end-any-\\\">end?: any;</h3>\\n<ul>\\n<li>Description: Draw the end coordinates of the area. The structure is as follows:</li>\\n</ul>\\n<pre><code>{\\n  x: <span class=\\\"hljs-number\\\">0</span>, <span class=\\\"hljs-comment\\\">// X has a range of (0,1).</span>\\n  y: <span class=\\\"hljs-number\\\">0</span> <span class=\\\"hljs-comment\\\">// Y has a range of (0,1).</span>\\n}\\n</code></pre><h3 id=\\\"animate-boolean\\\">animate?: boolean</h3>\\n<p>todo</p>\\n<ul>\\n<li>Description: Whether animations are executed by view, default to be executed.<blockquote>\\n<p>Be careful: The view created under the chart will default to the column definition, axis configuration, coordinate system coord configuration of the chart. That is, if the view is not self-defined, it defaults to the same configuration as the chart; if the view itself defines the corresponding configuration, then its own.</p>\\n</blockquote>\\n</li>\\n</ul>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/api/viserView/en.md?");

