eval("module.exports = \"<h2 id=\\\"-\\\">特点</h2>\\n<p>这里我们讨论下 viser 和 g2 的差异之处，这里我们以 viser-react 举例，以便于您的理解。</p>\\n<h3 id=\\\"-\\\">组件分类</h3>\\n<p>Viser 中所有的子组件分为几类：</p>\\n<ul>\\n<li>容器组件：Chart, View, FacetView, Facet, LiteChart；</li>\\n<li>标准组件：Coord, Tooltip, Legend, Guide, Axis, Series；</li>\\n<li>图形组件：Pie, Sector, Line, SmoothLine, DashLine, Area, StackArea, SmoothArea, Bar, StackBar, DodgeBar, Interval, StackInterval, DodgeInterval, Point, JitterPoint, Funnel, Pyramid, Schema, Box, Candle, Polygon, Contour, Heatmap, Edge, Sankey。</li>\\n</ul>\\n<p>容器组件代表它们是可以对应一组渲染，比如 Chart 容器包含组件绘制的所有步骤，而 G2 的图表可以由多个<a href=\\\"https://antv.alipay.com/zh-cn/g2/3.x/tutorial/how-to-create-view.html\\\">视图 View 构成</a>，同时各个视图可以拥有各自的数据源，那么 View 也会包含组件绘制的一部分步骤。此外 <a href=\\\"https://antv.alipay.com/zh-cn/g2/3.x/tutorial/facet.html\\\">Facet</a>, FacetView 是类似的，具体可以参考 demo 中的写法。</p>\\n<p>标准组件对应 <a href=\\\"https://antv.alipay.com/zh-cn/g2/3.x/tutorial/understanding-g2-charts.html\\\">G2 的图表组成</a> 包括了 Axis, Legend, Geom, Tooltip 和 Guide。对应到 viser 是 Axis, Legend, Series, Tooltip 和 Guide，另外将 Coord 也设置为组件。其中，Series 来代替 Geom，原因是大部分其它图表库更强调 Series 概念，G2 从图形语法层面将这一概念抽象成 Geom。</p>\\n<p>图形组件是对 Series 类型的扩展，其实就是所有 <a href=\\\"https://antv.alipay.com/zh-cn/g2/3.x/tutorial/geom.html\\\">geom 类型</a>。将它们具象化成组件，以方便在使用时理解。虽然我们还是可以用 Series 来做为组件，但推荐直接使用具体的图形名称来表示组件，例如 Bar 和 Line 等。这样方便语义化的使用。具体举例，比如：</p>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * G2\\n */</span>\\nchart.<span class=\\\"hljs-built_in\\\">line</span>().<span class=\\\"hljs-built_in\\\">position</span>(<span class=\\\"hljs-string\\\">'year*value'</span>);\\n</code></pre>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * Viser-react\\n */</span>\\n&lt;Line <span class=\\\"hljs-built_in\\\">position</span>=<span class=\\\"hljs-string\\\">\\\"year*value\\\"</span> /&gt;\\n</code></pre>\\n<h3 id=\\\"datakey-\\\">dataKey 字段映射</h3>\\n<p>对于字段映射的方式，viser 使用 <code>dataKey</code> 的方式来设置，与其它属性并列，比如在设置 <code>scale</code> 时，g2 的 <code>key</code> 就是数据的列字段，而 viser 里就是 <code>dataKey</code> 来表示：</p>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * G2\\n */</span>\\n<span class=\\\"hljs-selector-tag\\\">chart</span><span class=\\\"hljs-selector-class\\\">.scale</span>({\\n  <span class=\\\"hljs-attribute\\\">x</span>: { sync: true },\\n  <span class=\\\"hljs-selector-tag\\\">y</span>: { <span class=\\\"hljs-attribute\\\">sync</span>: true },\\n});\\n</code></pre>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * Viser-react\\n */</span>\\nconst scale = [{\\n<span class=\\\"hljs-symbol\\\">  dataKey:</span> <span class=\\\"hljs-string\\\">'x'</span>,\\n<span class=\\\"hljs-symbol\\\">  sync:</span> true,\\n}, {\\n<span class=\\\"hljs-symbol\\\">  dataKey:</span> <span class=\\\"hljs-string\\\">'y'</span>,\\n<span class=\\\"hljs-symbol\\\">  sync:</span> true,\\n}];\\n<span class=\\\"hljs-params\\\">&lt;Chart scale={scale} {...others}&gt;</span>\\n<span class=\\\"hljs-params\\\">&lt;/Chart&gt;</span>\\n</code></pre>\\n<p>其它，类似于 Legend, Axis 部分的字段映射使用同样的方式，用 <code>dataKey</code> 代表列字段。但在 Series 中并不是对单个字段映射，而且它是属性的一部分，因为我们的处理方式不同，使用数组的方式来表达。比如 <code>label</code> 属性中列字段是 <code>name</code>，并有配置，那么我们在 viser 中使用就直接使用一个数组来代表：</p>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * G2\\n */</span>\\n<span class=\\\"hljs-selector-tag\\\">nodeView</span><span class=\\\"hljs-selector-class\\\">.polygon</span>()\\n<span class=\\\"hljs-selector-class\\\">.position</span>(<span class=\\\"hljs-string\\\">'x*y'</span>)\\n<span class=\\\"hljs-selector-class\\\">.color</span>(<span class=\\\"hljs-string\\\">'id'</span>)\\n<span class=\\\"hljs-selector-class\\\">.label</span>(<span class=\\\"hljs-string\\\">'name'</span>, {\\n  <span class=\\\"hljs-attribute\\\">labelEmit</span>: true,\\n  <span class=\\\"hljs-attribute\\\">textStyle</span>: {\\n    <span class=\\\"hljs-attribute\\\">fill</span>: <span class=\\\"hljs-string\\\">'#8c8c8c'</span>\\n  }\\n});\\n</code></pre>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * Viser-react\\n */</span>\\n<span class=\\\"hljs-keyword\\\">const</span> label = [\\n  <span class=\\\"hljs-string\\\">'name'</span>, {\\n    <span class=\\\"hljs-attr\\\">labelEmit</span>: <span class=\\\"hljs-literal\\\">true</span>,\\n    <span class=\\\"hljs-attr\\\">textStyle</span>: {\\n      <span class=\\\"hljs-attr\\\">fill</span>: <span class=\\\"hljs-string\\\">'#8c8c8c'</span>\\n    },\\n  }\\n];\\n<span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Polygon</span> <span class=\\\"hljs-attr\\\">position</span>=<span class=\\\"hljs-string\\\">'x*y'</span> <span class=\\\"hljs-attr\\\">color</span>=<span class=\\\"hljs-string\\\">'id'</span> <span class=\\\"hljs-attr\\\">label</span>=<span class=\\\"hljs-string\\\">{label}</span> /&gt;</span></span>\\n</code></pre>\\n<h3 id=\\\"coord-\\\">Coord 的角度</h3>\\n<p><a href=\\\"https://antv.alipay.com/zh-cn/g2/3.x/tutorial/coord.html\\\">Coord</a> 默认的 <code>startAngle</code> 和 <code>endAngle</code> 是用弧度表示的，比如角度是 180 度，那么弧度用 js 表示就是 <code>2 * Math.PI</code>。对于使用者来说，还是角度更简单和直观，因此，viser 使用角度来替代弧度。</p>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * G2\\n */</span>\\nchart.coord(<span class=\\\"hljs-string\\\">'polar'</span>, {\\n  <span class=\\\"hljs-attr\\\">startAngle</span>: <span class=\\\"hljs-number\\\">2</span> * Math.<span class=\\\"hljs-literal\\\">PI</span>,\\n})\\n</code></pre>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * Viser-react\\n */</span>\\n&lt;<span class=\\\"hljs-type\\\">Coord</span> <span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">type</span></span>=<span class=\\\"hljs-string\\\">\\\"polar\\\"</span> startAngle={<span class=\\\"hljs-number\\\">180</span>} /&gt;\\n</code></pre>\\n<h3 id=\\\"coord-\\\">Coord 的方向</h3>\\n<p>Coord 组件用于表示 g2 中 coord 的相关内容。针对直角坐标系的图表，我们提供了 <code>direction</code> 这一优化后的参数用来展现 g2 中的 <code>transpose</code>, <code>reflect</code> 和 <code>scale</code> 这几个属性。根据 X 轴，Y 轴的位置，我们提供了 8 种坐标系的排列，分别有 BL, BR, LT, LB, RB, RT, TL, TR。B 代表 bottom, T 代表 top，L 代表 left，R 代表 right。具体举例，比如：</p>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * G2\\n */</span>\\n<span class=\\\"hljs-selector-tag\\\">chart</span><span class=\\\"hljs-selector-class\\\">.coord</span>()<span class=\\\"hljs-selector-class\\\">.transpose</span>()<span class=\\\"hljs-selector-class\\\">.scale</span>(1, <span class=\\\"hljs-selector-tag\\\">-1</span>);\\n</code></pre>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * Viser-react\\n */</span>\\n&lt;<span class=\\\"hljs-type\\\">Coord</span> <span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">type</span></span>=<span class=\\\"hljs-string\\\">\\\"rect\\\"</span> direction=<span class=\\\"hljs-string\\\">\\\"LT\\\"</span> /&gt;\\n</code></pre>\\n<p>直角坐标系映射关系如下：</p>\\n<table>\\n<thead>\\n<tr>\\n<th style=\\\"text-align:left\\\">direction</th>\\n<th style=\\\"text-align:left\\\">配置</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td style=\\\"text-align:left\\\">BL(默认）</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">BR</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).scale(-1, 1);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">LT</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose().scale(1, -1);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">LB</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose();</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">RB</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose().reflect();</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">RT</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose().reflect().scale(-1, 1);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">TL</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect();</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">TR</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect().scale(-1, 1);</td>\\n</tr>\\n</tbody>\\n</table>\\n<p>同理，对于极坐标系我们也提供了 4 种方向，最主要是 <code>rotate</code> 和 <code>reverse</code> 两种，具体映射关系如下：</p>\\n<table>\\n<thead>\\n<tr>\\n<th style=\\\"text-align:left\\\">direction</th>\\n<th style=\\\"text-align:left\\\">配置</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td style=\\\"text-align:left\\\">rotate</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).transpose();</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">xReverse</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect(&#39;x&#39;);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">yReverse</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect(&#39;y&#39;);</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">reverse</td>\\n<td style=\\\"text-align:left\\\">chart.coord(&#39;rect&#39;).reflect();</td>\\n</tr>\\n</tbody>\\n</table>\\n<h3 id=\\\"guide-\\\">Guide 的类型</h3>\\n<p>Guide 在 g2 中直接会指定，比如 <code>chart.guide().line()</code>，在 viser 中均使用 Guide 组件，类型就使用 <code>type</code> 字段来表示，比如：</p>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * G2\\n */</span>\\n<span class=\\\"hljs-selector-tag\\\">chart</span><span class=\\\"hljs-selector-class\\\">.guide</span>()<span class=\\\"hljs-selector-class\\\">.line</span>()\\n</code></pre>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * Viser-react\\n */</span>\\n&lt;<span class=\\\"hljs-type\\\">Guide</span> <span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">type</span></span>=<span class=\\\"hljs-string\\\">\\\"line\\\"</span> /&gt;\\n</code></pre>\\n<p>另外，提供了两种平行和正交快捷设置，因此增加了 <code>quickType</code> 的字段，value 则对应是 <code>parallel</code> 和 <code>normal</code>，比如：</p>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * G2\\n */</span>\\n<span class=\\\"hljs-selector-tag\\\">chart</span><span class=\\\"hljs-selector-class\\\">.guide</span><span class=\\\"hljs-selector-class\\\">.line</span>({\\n  <span class=\\\"hljs-attribute\\\">start</span>: [<span class=\\\"hljs-string\\\">'min'</span>, <span class=\\\"hljs-number\\\">2</span>],\\n  end: [<span class=\\\"hljs-string\\\">'max'</span>, <span class=\\\"hljs-number\\\">2</span>],\\n});\\n</code></pre>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * Viser-react\\n */</span>\\n&lt;Guide <span class=\\\"hljs-keyword\\\">type</span>=<span class=\\\"hljs-string\\\">\\\"line\\\"</span> quickType=<span class=\\\"hljs-string\\\">\\\"parallel\\\"</span> <span class=\\\"hljs-built_in\\\">data</span>={<span class=\\\"hljs-number\\\">2</span>} /&gt;\\n</code></pre>\\n<h3 id=\\\"formatter-\\\">Formatter 格式化方法</h3>\\n<p>我们加入了 <code>d3-format</code> 库来增强 <code>label</code> 需要数据处理的能力，也就是说简单场景下的数据格式化，可以直接用 d3 提供的格式化表达式来完成。比如：</p>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * G2\\n */</span>\\n<span class=\\\"hljs-selector-tag\\\">chart</span><span class=\\\"hljs-selector-class\\\">.scale</span>({\\n  <span class=\\\"hljs-attribute\\\">percent</span>: {\\n    min: <span class=\\\"hljs-number\\\">0</span>,\\n    <span class=\\\"hljs-built_in\\\">formatter</span>(val) {\\n      return (val * <span class=\\\"hljs-number\\\">100</span>).<span class=\\\"hljs-built_in\\\">toFixed</span>(2) + <span class=\\\"hljs-string\\\">'%'</span>;\\n    }\\n  }\\n});\\n</code></pre>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * Viser-react\\n */</span>\\n<span class=\\\"hljs-keyword\\\">const</span> <span class=\\\"hljs-built_in\\\">scale</span> = [{\\n  dataKey: <span class=\\\"hljs-string\\\">'percent'</span>,\\n  <span class=\\\"hljs-built_in\\\">min</span>: <span class=\\\"hljs-number\\\">0</span>,\\n  formatter: <span class=\\\"hljs-string\\\">'.2%'</span>,\\n}];\\n</code></pre>\\n<h3 id=\\\"-\\\">事件</h3>\\n<p>Viser 的事件对于 <a href=\\\"https://antv.alipay.com/zh-cn/g2/3.x/tutorial/chart-event.html\\\">g2 的事件</a> 来说看起来不太一样，viser 是直接绑定在元素上的，因此对于事件来说，在哪里用就在哪里绑定。但 g2 使用中常常使用到 chart 实例，因此 viser 将 chart 实例放在了回调函数第二个参数上，比如：</p>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * G2\\n */</span>\\n<span class=\\\"hljs-selector-tag\\\">chart</span><span class=\\\"hljs-selector-class\\\">.on</span>(<span class=\\\"hljs-string\\\">'mousedown'</span>, ev =&gt; {});\\n</code></pre>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-comment\\\">/*\\n * Viser-react\\n */</span>\\nhandleMouseDown = <span class=\\\"hljs-function\\\">(<span class=\\\"hljs-params\\\">ev, chart</span>) =&gt;</span> {}\\n&lt;Chart onMouseDown={<span class=\\\"hljs-keyword\\\">this</span>.handleMouseDown}&gt;\\n<span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">Chart</span>&gt;</span></span>\\n</code></pre>\\n<p>对于 Axis 来说，原来的 <code>chart.on(&#39;axis-title: click&#39;, ev =&gt; {})</code>，在 Axis 上绑定就会有一个 <code>onTitleClick</code> 的属性，其它的以此类推。</p>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/guide/feature/cn.md?");

