eval("module.exports = \"<h2 id=\\\"-\\\">安装</h2>\\n<p>Viser Viser-Graph 为 React, Vue 和 Angular 提供了 3 个不同的分发版本。我们同时提供了 npm 安装和 umd 引入两种方式来使用 Viser。</p>\\n<p>npm 安装是使用 Viser 最简单也是最快捷的方式。我们强烈建议您在开发单页应用(SPA)时采用这种方式进行安装。Viser 可以完美兼容 CommonJS 打包工具，例如我们最常用的 Webpack。</p>\\n<p>UMD 引入是使用 script 标签引入来使用 Viser。当你需要快速使用的时候，这是最便捷的方式。</p>\\n<h3 id=\\\"vue-\\\">Vue 分发版</h3>\\n<p>您需要使用版本 <strong>2.5</strong> 及以上的 Vue，来使用 Vue 分发版 Viser。</p>\\n<h4 id=\\\"npm\\\">npm</h4>\\n<p>在终端使用如下命令来安装 npm 版本：</p>\\n<pre><code class=\\\"lang-shell\\\"><span class=\\\"hljs-comment\\\"># latest stable</span>\\n$ npm <span class=\\\"hljs-keyword\\\">install</span> viser-vue\\n</code></pre>\\n<h4 id=\\\"umd\\\">umd</h4>\\n<p>我们在 unpkg.com 上提供了 UMD 的版本:</p>\\n<pre><code class=\\\"lang-html\\\"> <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">script</span> <span class=\\\"hljs-attr\\\">src</span>=<span class=\\\"hljs-string\\\">\\\"https://unpkg.com/viser-vue/umd/viser-vue.min.js\\\"</span>&gt;</span><span class=\\\"undefined\\\"></span><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">script</span>&gt;</span>\\n</code></pre>\\n<p>然后你可以使用全局变量 <code>window.ViserVue</code> 来进行调用 Viser。</p>\\n<h3 id=\\\"angular-\\\">Angular 分发版</h3>\\n<p>您需要使用版本 <strong>2.4</strong> 及以上的 Angular，来使用 Angular 分发版 Viser。另外，你还需要版本 <strong>0.1</strong> 及以上的 reflect-metadata，版本 <strong>5</strong> 及以上的 rxjs，版本 <strong>0.7</strong> 及以上的 zone.js。</p>\\n<h4 id=\\\"npm\\\">npm</h4>\\n<p>在终端使用如下命令来安装 npm 版本：</p>\\n<pre><code class=\\\"lang-shell\\\"><span class=\\\"hljs-comment\\\"># latest stable</span>\\n$ npm <span class=\\\"hljs-keyword\\\">install</span> viser-ng\\n</code></pre>\\n<h4 id=\\\"umd\\\">umd</h4>\\n<p>我们在 unpkg.com 上提供了 UMD 的版本:</p>\\n<pre><code class=\\\"lang-html\\\"> <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">script</span> <span class=\\\"hljs-attr\\\">src</span>=<span class=\\\"hljs-string\\\">\\\"https://unpkg.com/viser-ng/umd/viser-ng.min.js\\\"</span>&gt;</span><span class=\\\"undefined\\\"></span><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">script</span>&gt;</span>\\n</code></pre>\\n<p>然后你可以使用全局变量 <code>window.ViserNg</code> 来进行调用 Viser。</p>\\n<h3 id=\\\"react-\\\">React 分发版</h3>\\n<p>您需要使用版本 <strong>15</strong> 及以上的 React，来使用 React 分发版 Viser。显然，版本 <strong>16</strong> 也是可以的。</p>\\n<h4 id=\\\"npm\\\">npm</h4>\\n<p>在终端使用如下命令来安装 npm 版本：</p>\\n<pre><code class=\\\"lang-shell\\\"><span class=\\\"hljs-comment\\\"># latest stable</span>\\n$ npm <span class=\\\"hljs-keyword\\\">install</span> viser-react\\n</code></pre>\\n<h4 id=\\\"umd\\\">umd</h4>\\n<p>我们在 unpkg.com 上提供了 UMD 引入的版本:</p>\\n<pre><code class=\\\"lang-html\\\"> <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">script</span> <span class=\\\"hljs-attr\\\">src</span>=<span class=\\\"hljs-string\\\">\\\"https://unpkg.com/viser-react/umd/viser-react.min.js\\\"</span>&gt;</span><span class=\\\"undefined\\\"></span><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">script</span>&gt;</span>\\n</code></pre>\\n<p>然后你可以使用全局变量 <code>window.ViserReact</code> 来进行调用 Viser。</p>\\n<h2 id=\\\"demo\\\">Demo</h2>\\n<p>To examine the demos in your local build, open to <code>demo</code> directory, and execute</p>\\n<pre><code class=\\\"lang-shell\\\"><span class=\\\"hljs-meta\\\">$</span><span class=\\\"bash\\\"> git <span class=\\\"hljs-built_in\\\">clone</span> https://github.com/viserjs/viser.git</span>\\n<span class=\\\"hljs-meta\\\">$</span><span class=\\\"bash\\\"> npm run postinstall</span>\\n<span class=\\\"hljs-meta\\\">$</span><span class=\\\"bash\\\"> <span class=\\\"hljs-built_in\\\">cd</span> ./demo &amp;&amp; npm install</span>\\n<span class=\\\"hljs-meta\\\">$</span><span class=\\\"bash\\\"> npm run start</span>\\n</code></pre>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/guide/installation/cn.md?");

