eval("module.exports = \"<h2 id=\\\"-\\\">简介</h2>\\n<p>Viser 一个基于 G2 实现的，为数据可视化工程师量身定制的工具。\\nViser-Graph 一个基于 G6 实现的，为呈现关系型数据的定制化工具。</p>\\n<p>Viser Viser-Graph 现已支持几大主流前端框架，例如 React, Vue 和 AngularJS。</p>\\n<h3 id=\\\"-\\\">核心价值</h3>\\n<p>它可以开发网页应用的过程中，为图表开发带来卓越的体验。</p>\\n<h3 id=\\\"-\\\">设计原则</h3>\\n<ol>\\n<li>利用语义化组件来组合图表。包括但不限于 React, Vue 和 AugularJS 的组件。</li>\\n<li>脱胎于 G2，一套基于可视化编码的图形语法。由此带来了强大的可视化能力。</li>\\n</ol>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/guide/introduction/cn.md?");

