eval("module.exports = \"<h2 id=\\\"introduction\\\">Introduction</h2>\\n<p>A toolkit fit for data vis engineer based on G2. Viser support React, Vue and AngularJS.</p>\\n<h3 id=\\\"main-purpose\\\">Main Purpose</h3>\\n<p>The main purpose of this library is to help you to write charts in web applications without any pain.</p>\\n<h3 id=\\\"main-principles\\\">Main Principles</h3>\\n<ol>\\n<li>Simply deploy with semantic component with chart, including but not limited to React, Vue and AugularJS.</li>\\n<li>Lightweight depending only on G2 which is a plotting system for Javascript, based on the grammar of graphics.</li>\\n</ol>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/guide/introduction/en.md?");

