eval("module.exports = \"<h2 id=\\\"rendering\\\">Rendering</h2>\\n<p>At present, all charts support two rendering engines, and the same page can also be mixed with two rendering engines, you can rest assured that use.</p>\\n<h3 id=\\\"usage-mode\\\">Usage mode</h3>\\n<pre><code><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Chart</span> <span class=\\\"hljs-attr\\\">height</span>=<span class=\\\"hljs-string\\\">{400}</span> <span class=\\\"hljs-attr\\\">data</span>=<span class=\\\"hljs-string\\\">{data}</span> <span class=\\\"hljs-attr\\\">renderer</span>=<span class=\\\"hljs-string\\\">'svg'</span> /&gt;</span>\\n\\n<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Chart</span> <span class=\\\"hljs-attr\\\">height</span>=<span class=\\\"hljs-string\\\">{400}</span> <span class=\\\"hljs-attr\\\">data</span>=<span class=\\\"hljs-string\\\">{data}</span> <span class=\\\"hljs-attr\\\">renderer</span>=<span class=\\\"hljs-string\\\">'canvas'</span> /&gt;</span>\\n</code></pre><h3 id=\\\"svg-vs-canvas\\\">svg VS canvas</h3>\\n<p>HTML5 provides both Canvas and SVG, as well as rendering techniques used by most Web chart libraries. Canvas is based on script and dynamically drafting through JavaScript instructions. SVG uses XML to describe Vectorgraph. They have different application scenarios.</p>\\n<h3 id=\\\"application-scenary\\\">Application scenary</h3>\\n<p>Canvas provides a lower level of graphics capabilities, suitable for pixel-level graphics processing, dynamic rendering and rendering of large amounts of data graphics. SVG has a higher level of abstraction, a richer declarative and descriptive interface, a large number of graphics, filters and animations built-in to facilitate the maintenance of document elements, but also can be exported out of the browser environment for use.</p>\\n<p>The following diagram describes the appropriate scenarios for different rendering techniques from the general level.\\n<img src=\\\"https://gw.alipayobjects.com/zos/rmsportal/pqfukMDPRpEvIYNvddxN.jpg\\\" /></p>\\n<h3 id=\\\"performance-difference\\\">Performance difference</h3>\\n<p>Previous articles on the Internet comparing the performance of Canvas and SVG concluded that &quot;Canvas has better performance and is suitable for rendering larger amounts of data&quot;. In fact, this is biased. Performance contrast depends on the scene. At the bottom, the performance of Canvas is more affected by canvas size, while the performance of SVG is more affected by the number of graphic elements. The following is a comparison map given on Microsoft MSDN.</p>\\n<p><img src=\\\"https://gw.alipayobjects.com/zos/rmsportal/nNSsPFkNcAoxQTfHfZes.png\\\"/></p>\\n<p>And in the case of small data volume, SVG schemes usually occupy less memory, do zooming, translation and other operations tend to frame rate is higher.</p>\\n<h3 id=\\\"summary\\\">Summary</h3>\\n<p>If you only look at the view of the chart library, Canvas and SVG have their own advantages. Small canvas and large data scenes are suitable for Canvas, such as thermodynamic charts and scatter plots of large data. If the canvas is very large, high-frequency interaction such as scaling, translation, or the mobile terminal which is very sensitive to memory usage, you can use the SVG.</p>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/guide/render/en.md?");

