eval("module.exports = \"<h2 id=\\\"-\\\">用法</h2>\\n<p>我们以 viser-react 举例写<a href=\\\"https://antv.alipay.com/zh-cn/g2/3.x/demo/relation/chord.html\\\">一个 chore 图为例</a>，viser-vue 和 viser-ng 的用法类似。</p>\\n<h3 id=\\\"-\\\">引入库</h3>\\n<p>首先是引入 viser-react 的需要的子组件，以及必要的依赖，如 React, ReactDOM。</p>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-keyword\\\">import</span> { Chart, Tooltip, Edge, <span class=\\\"hljs-keyword\\\">View</span>, <span class=\\\"hljs-type\\\">Polygon</span>, Coord } <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'viser-react'</span>;\\n<span class=\\\"hljs-keyword\\\">import</span> * <span class=\\\"hljs-keyword\\\">as</span> ReactDOM <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'react-dom'</span>;\\n<span class=\\\"hljs-keyword\\\">import</span> * <span class=\\\"hljs-keyword\\\">as</span> React <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'react'</span>;\\n</code></pre>\\n<h3 id=\\\"-\\\">数据处理</h3>\\n<p>数据处理完全沿用 data-set.js 的处理。data-set 有丰富的数据处理方法，具体请参考 g2 官网的 <a href=\\\"https://antv.alipay.com/zh-cn/g2/3.x/tutorial/data-set.html\\\">data-set 部分</a>.</p>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-keyword\\\">const</span> DataSet = <span class=\\\"hljs-built_in\\\">require</span>(<span class=\\\"hljs-string\\\">'@antv/data-set'</span>);\\n\\n<span class=\\\"hljs-keyword\\\">const</span> ds: <span class=\\\"hljs-built_in\\\">any</span> = <span class=\\\"hljs-keyword\\\">new</span> DataSet();\\n<span class=\\\"hljs-keyword\\\">const</span> dv = ds.createView().source(data, {\\n  <span class=\\\"hljs-keyword\\\">type</span>: <span class=\\\"hljs-string\\\">'graph'</span>,\\n  edges: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-params\\\">d</span> =&gt;</span> d.links\\n});\\n\\ndv.transform({\\n  <span class=\\\"hljs-keyword\\\">type</span>: <span class=\\\"hljs-string\\\">'diagram.arc'</span>,\\n  sourceWeight: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-params\\\">e</span> =&gt;</span> e.sourceWeight,\\n  targetWeight: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-params\\\">e</span> =&gt;</span> e.targetWeight,\\n  weight: <span class=\\\"hljs-literal\\\">true</span>,\\n  marginRatio: <span class=\\\"hljs-number\\\">0.3</span>\\n});\\n</code></pre>\\n<h3 id=\\\"-\\\">图表实现</h3>\\n<p>图表实现完全沿用 g2 对于图形语法的表达。</p>\\n<p>我们观察原生 g2 的语法：</p>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-keyword\\\">const</span> chart = <span class=\\\"hljs-keyword\\\">new</span> G2.Chart({\\n  container: <span class=\\\"hljs-string\\\">'mountNode'</span>,\\n  forceFit: <span class=\\\"hljs-keyword\\\">true</span>,\\n  <span class=\\\"hljs-built_in\\\">height</span>: window.innerHeight\\n});\\nchart.legend(<span class=\\\"hljs-keyword\\\">false</span>);\\nchart.tooltip({\\n  showTitle: <span class=\\\"hljs-keyword\\\">false</span>\\n});\\n\\nchart.<span class=\\\"hljs-built_in\\\">scale</span>({\\n  x: {\\n    sync: <span class=\\\"hljs-keyword\\\">true</span>\\n  },\\n  y: {\\n    sync: <span class=\\\"hljs-keyword\\\">true</span>\\n  }\\n});\\n\\n<span class=\\\"hljs-keyword\\\">const</span> edgeView = chart.view();\\nedgeView.source(dv.edges);\\nedgeView.coord(<span class=\\\"hljs-string\\\">'polar'</span>).reflect(<span class=\\\"hljs-string\\\">'y'</span>);\\nedgeView.axis(<span class=\\\"hljs-keyword\\\">false</span>);\\nedgeView.edge()\\n  .position(<span class=\\\"hljs-string\\\">'x*y'</span>)\\n  .<span class=\\\"hljs-built_in\\\">shape</span>(<span class=\\\"hljs-string\\\">'arc'</span>)\\n  .<span class=\\\"hljs-built_in\\\">color</span>(<span class=\\\"hljs-string\\\">'source'</span>)\\n  .opacity(<span class=\\\"hljs-number\\\">0.5</span>)\\n  .tooltip(<span class=\\\"hljs-string\\\">'source*target*value'</span>);\\n\\n<span class=\\\"hljs-keyword\\\">const</span> nodeView = chart.view();\\nnodeView.source(dv.nodes);\\nnodeView.coord(<span class=\\\"hljs-string\\\">'polar'</span>).reflect(<span class=\\\"hljs-string\\\">'y'</span>);\\nnodeView.axis(<span class=\\\"hljs-keyword\\\">false</span>);\\nnodeView.polygon()\\n  .position(<span class=\\\"hljs-string\\\">'x*y'</span>)\\n  .<span class=\\\"hljs-built_in\\\">color</span>(<span class=\\\"hljs-string\\\">'id'</span>)\\n  .label(<span class=\\\"hljs-string\\\">'name'</span>, {\\n    labelEmit: <span class=\\\"hljs-keyword\\\">true</span>,\\n    textStyle: {\\n      <span class=\\\"hljs-built_in\\\">fill</span>: <span class=\\\"hljs-string\\\">'#8c8c8c'</span>\\n    }\\n  });\\n\\nchart.render();\\n</code></pre>\\n<p>我们看到有几个部分，Chart, Lengend, Tooltip, Scale 的配置，这些是公共配置，g2 提供 View 的能力，因此对应到 viser-react 中也需要两个 View，一个是边（edge），一个是节点（node）。然后每一个 api 都被抽象成了配置，而不是连续的调用。所以，我们看到对应到 viser-react 中的代码是：</p>\\n<pre><code class=\\\"lang-js\\\"><span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">class</span> <span class=\\\"hljs-title\\\">App</span> <span class=\\\"hljs-keyword\\\">extends</span> <span class=\\\"hljs-title\\\">React</span>.<span class=\\\"hljs-title\\\">Component</span> </span>{\\n  constructor(props) {\\n    <span class=\\\"hljs-keyword\\\">super</span>(props);\\n  }\\n\\n  render() {\\n    const label = [\\n      <span class=\\\"hljs-symbol\\\">'nam</span>e', {\\n        labelEmit: <span class=\\\"hljs-literal\\\">true</span>,\\n        textStyle: {\\n          fill: '#<span class=\\\"hljs-number\\\">8</span>c8c8c'\\n        },\\n      }\\n    ];\\n\\n    const scale = [{\\n      dataKey: 'x',\\n      sync: <span class=\\\"hljs-literal\\\">true</span>,\\n    }, {\\n      dataKey: 'y',\\n      sync: <span class=\\\"hljs-literal\\\">true</span>,\\n    }];\\n\\n    <span class=\\\"hljs-keyword\\\">return</span> (\\n      &lt;div&gt;\\n        &lt;<span class=\\\"hljs-type\\\">Chart</span> forceFit height={window.innerHeight} scale={scale}&gt;\\n          &lt;<span class=\\\"hljs-type\\\">View</span> data={dv.edges}&gt;\\n            &lt;<span class=\\\"hljs-type\\\">Coord</span> <span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">type</span></span>=<span class=\\\"hljs-string\\\">\\\"polar\\\"</span> direction=<span class=\\\"hljs-string\\\">\\\"yReverse\\\"</span> /&gt;\\n            &lt;<span class=\\\"hljs-type\\\">Edge</span> position=<span class=\\\"hljs-symbol\\\">'x</span>*y' color=<span class=\\\"hljs-symbol\\\">'sourc</span>e' shape=<span class=\\\"hljs-symbol\\\">'ar</span>c' opacity={<span class=\\\"hljs-number\\\">0.5</span>} tooltip={<span class=\\\"hljs-symbol\\\">'source</span>*target*value'} /&gt;\\n          &lt;/<span class=\\\"hljs-type\\\">View</span>&gt;\\n          &lt;<span class=\\\"hljs-type\\\">View</span> data={dv.nodes}&gt;\\n            &lt;<span class=\\\"hljs-type\\\">Coord</span> <span class=\\\"hljs-class\\\"><span class=\\\"hljs-keyword\\\">type</span></span>=<span class=\\\"hljs-string\\\">\\\"polar\\\"</span> direction=<span class=\\\"hljs-string\\\">\\\"yReverse\\\"</span> /&gt;\\n            &lt;<span class=\\\"hljs-type\\\">Polygon</span> position=<span class=\\\"hljs-symbol\\\">'x</span>*y' color=<span class=\\\"hljs-symbol\\\">'i</span>d' label={label} /&gt;\\n          &lt;/<span class=\\\"hljs-type\\\">View</span>&gt;\\n        &lt;/<span class=\\\"hljs-type\\\">Chart</span>&gt;\\n      &lt;/div&gt;\\n    );\\n  }\\n}\\n</code></pre>\\n<h3 id=\\\"-\\\">最后</h3>\\n<p>对于图表实现上，都是 g2 图形语法的特性，并不是 viser 提供的，viser 提供的是框架级别的轻量级封装。希望你可以先对 g2 的用法熟悉，viser 不会单独列 g2 的 API，但我们会对一些 viser 的特点单独列出。</p>\\n\";\n\n//# sourceURL=webpack:///./pages/docs/mds/guide/usage/cn.md?");

